INSERT INTO `book` VALUES (1, '红楼梦', '[清] 曹雪芹 著 / 高鹗', 9.6, 419438, '人民文学出版社', '1996-12-01', '59.7', 's1070959.jpg', '长篇小说', '《红楼梦》是一部百科全书式的长篇小说。以宝黛爱情悲剧为主线，以四大家族的荣辱兴衰为背景，描绘出18世纪中国封建社会的方方面面，以及封建专制下新兴资本主义民主思想的萌动。结构宏大、情节委婉、细节精致，人物形象栩栩如生，声口毕现，堪称中国古代小说中的经 典。\n\n由红楼梦研究所校注、人民文学出版社出版的《红楼梦》以庚辰（1760）本《脂砚斋重评石头记》为底本，以甲戌（1754）本、已卯（1759）本、蒙古王府本、戚蓼生序本、舒元炜序本、郑振铎藏本、红楼梦稿本、列宁格勒藏本（俄藏本）、程甲本、程乙本等众多版本为参校本，是一个博采众长、非常适合大众阅读的本子；同时，对底本的重要修改，皆出校记，读者可因以了解《红楼梦》的不同版本状况。\n\n红学所的校注本已印行二十五年，其间1994年曾做过一次修订，又十几年过去，2008年推出修订第三版，体现了新的校注成果和科研成果。\n\n关于《红楼梦》的作者，原本就有多种说法及推想，“前八十回曹雪芹著、后四十回高鹗续”的说法只是其中之一，这次修订中校注者改为“前八十回曹雪芹著；后四十回无名氏续，程伟元、高鹗整理”，应当是一种更科学的表述，体现了校注者对这一问题的新的认识。\n\n现在这个修订后的《红楼梦》是更加完善。', '曹雪芹,（？-1763，一作1764）清小说家。名霑，字梦阮，号雪芹、芹圃、芹溪。为满洲正白旗“包衣”人。自曾祖起，三代任江宁织造，其祖曹寅尤为康熙帝所信用。雍正初年，在统计阶级内部政治斗争牵连下，雪芹家受到重大打击，其父免职，产业被抄，遂随家迁居北京。他早年经历了一段封建大官僚地主家庭的繁华生活，后因家道衰落，趋于艰困。晚期居北京西郊，贫病而卒，年未及五十。性情高傲，嗜酒健谈。具有深厚的文化修养和卓越的艺术才能。他生活在我国已有资本主义生产萌芽的封建末世，在其后期又有机会接触到下层人民，因而对当时社会阶级斗争和思想斗争有较具体的感受，看到了统治阶级的腐朽凶残和内部的分崩离析。曾以十年时间，从事《石头记》（即《红楼梦》）的创作。书中通过一个贵族官僚大家庭的盛衰历史的描写，塑造了许多典型人物形象，对当时社会的黑暗腐败，进行了深刻的解剖和批判，并热情地歌颂了具有异端思想的男女青年，成为我国古典小说中伟大的现实主义作品。但其中也反映了作者为封建制度“补天”的幻想和找不到出路的悲观情绪。据称先后曾增删五次，但未成全书而卒；今流行本一百二十回，后四十回一般认为是高鹗所续。也能诗，又善画石，但作品流传绝少。', '第一回 甄士隐梦幻识通灵 贾雨村风尘怀闺秀\n第二回 贾夫人仙逝扬州城 冷子兴演说荣国府\n第三回 托内兄如海酬训教 接外孙贾母惜孤女\n第四回 薄命女偏逢薄命郎 葫芦僧乱判葫芦案\n第五回 游幻境指迷十二钗 饮仙醪曲演红楼梦\n第六回 贾宝玉初试云雨情 刘姥姥一进荣国府\n第七回 送宫花贾琏戏熙凤 宴宁府宝玉会秦钟\n第八回 比通灵金莺微露意 探宝钗黛玉半含酸\n第九回 恋风流情友入家塾 起嫌疑顽童闹学堂\n第十回 金寡妇贪利权受辱 张太医论病细穷源\n第十一回 庆寿辰宁府排家宴 见熙凤贾瑞起淫心\n第十二回 王熙凤毒设相思局 贾天祥正照风月鉴\n第十三回 秦可卿死封龙禁尉 王熙凤协理宁国府\n第十四回 林如海捐馆扬州城 贾宝玉路谒北静王\n第十五回 王凤姐弄权铁槛寺 秦鲸卿得趣馒头庵\n第十六回 贾元春才选凤藻宫 秦鲸卿夭逝黄泉路\n第十七回 大观园试才题封额 荣国府归省庆元宵\n第十八回 皇恩重元妃省父母 天伦乐宝玉呈才藻\n第十九回 情切切良宵花解语 意绵绵静日玉生香\n第二十回 王熙凤正言弹妒意 林黛玉俏语谑娇音\n第二十一回 贤袭人娇嗔箴宝玉 俏平儿软语救贾琏\n第二十二回 听曲文宝玉悟禅机 制灯谜贾政悲谶语\n第二十三回 西厢记妙词通戏语 牡丹亭艳曲警芳心\n第二十四回 醉金刚轻财尚义侠 痴女儿遗帕惹相思\n第二十五回 魇魔法叔嫂逢五鬼 红楼梦通灵遇双真\n第二十六回 蜂腰桥设言传密意 潇湘馆春困发幽情\n第二十七回 滴翠亭杨妃戏彩蝶 埋香冢飞燕泣残红\n第二十八回 蒋玉菡情赠茜香罗 薛宝钗羞笼红麝串\n第二十九回 享福人福深还祷福 痴情女情重愈斟情\n第三十回 宝钗借扇机带双敲 龄官划蔷痴及局外\n第三十一回 撕扇子作千金一笑 因麒麟伏白首双星\n第三十二回 诉肺腑心迷活宝玉 含耻辱情烈死金钏\n第三十三回 手足耽耽小动唇舌 不肖种种大承笞挞\n第三十四回 情中情因情感妹妹 错里错以错劝哥哥\n第三十五回 白玉钏亲