INSERT INTO `book` VALUES (11, '福尔摩斯探案全集（上中下）', '[英] 阿瑟·柯南·道尔', 9.3, 132169, '群众出版社', '1981-08-02', '68', 's1229240.jpg', '悬疑推理', '最经典的群众出版社的翻译版本，一经出版，立即风靡成千上万的中国人。离奇的情节，扣人的悬念，世界上最聪明的侦探，人间最诡秘的案情，福尔摩斯不但让罪犯无处藏身，也让你的脑细胞热情激荡，本套书获第一届全国优秀外国文学图书奖。', '柯南道尔（1859-1930）生于苏格兰爱丁堡附近的皮卡地普拉斯，父亲是政府建工部的公务员。青海年时期在教会学校学习，的来在爱丁堡大学攻读医学，一八八五年获医学博士学位。一九0二年，因对英国在南非战争的政策辩护而被封爵。', '上卷：\n血字的研究\n一 歇洛克・福尔摩斯先生\n二 演绎法\n三 劳瑞斯顿花园街的惨案\n四 警察栾斯的叙述\n五 广告引来了不速之客\n六 特白厄斯・葛莱森大显身手\n七 一线光明\n八 沙漠中的旅客\n九 犹他之花\n十 约翰・费瑞厄和先知的会谈\n十一 逃命\n十二 复仇天使\n十三 再录华生回忆录\n十四 尾声\n四签名\n一 演绎法的研究\n二 案情的陈述\n三 寻求解答\n四 秃头人的故事\n五 樱沼别墅的惨案\n六 福尔摩斯作出判断\n七 木桶的插曲\n八 贝克街的侦探小队\n九 线索的中断\n十 凶手的末日\n十一 大宗阿格拉宝物\n十二 琼诺赞・斯茂的奇异故事\n冒险史\n波希米亚丑闻\n红发会\n身分案\n博斯科姆比溪谷秘案\n五个桔核\n歪唇男人\n蓝宝石案\n斑点带子案\n工程师大拇指案\n贵族单身汉案\n绿玉皇冠案\n铜山毛榉案\n中卷：\n回忆录\n银色马\n黄面人\n证券经纪人的书记员\n“格洛里亚斯科特”号三桅帆船\n马斯格雷夫礼典\n赖盖特之谜\n驼背人\n住院的病人\n希腊译员\n海军协定\n最后一案\n归来记\n空屋\n诺伍德的建筑师\n跳舞的人\n孤身骑车人\n修道院公学\n黑彼得\n米尔沃顿\n六座拿破仑半身像\n三个大学生\n金边夹鼻眼镜\n失踪的中卫\n格兰其庄园\n第二块血迹\n巴斯克维尔的猎犬\n一 歇洛克・福尔摩斯先生\n二 巴斯克维尔的灾祸\n三 疑案\n四 亨利・巴斯克维尔爵士\n五 三条断了的线索\n六 巴斯克维尔庄园\n七 梅利琵宅邸的主人斯台普吞\n八 华生医生的第一份报告\n九 华生医生的第二份报告\n十 华生医生日记摘录\n十一 岩岗上的人\n十二 沼地的惨剧\n十三 设网\n十四 巴斯克维尔的猎犬\n十五 回顾\n下卷：\n恐怖谷\n第一部 伯尔斯通的悲剧\n一 警告\n二 福尔摩斯的论述\n三 伯尔斯通的悲剧\n四 黑暗\n五 剧中人\n六 一线光明\n七 谜底\n第二部 死酷党人\n一 此人\n二 身主\n三 维尔米萨三百四十一分会\n四 恐怖谷\n五 最黑暗的时刻\n六 危机\n七 伯尔弟・爱德华的妙计\n八 尾声\n最后致意\n前言\n威斯特里亚寓所\n硬纸盒子\n红圈会\n布鲁斯－帕廷顿计划\n临终的侦探\n弗朗西丝・卡法克斯女士的失踪\n魔鬼之足\n最后致意\n新探案\n序言\n显贵的主顾\n皮肤变白的军人\n王冠宝石案\n三角墙山庄\n吸血鬼\n三个同姓人\n雷神桥之谜\n爬行人\n狮鬃毛\n带面纱的房客\n肖斯科姆别墅\n退休的颜料商');
INSERT INTO `book` VALUES (12, '白夜行', '[日] 东野圭吾', 9.2, 467769, '南海出版公司', '2013-01-01', '39.5', 's24514468.jpg', '悬疑推理', '东野圭吾万千书迷心中的无冕之王\n\n周刊文春推理小说年度BEST10第1名\n\n本格推理小说年度BEST10第2名\n\n《白夜行》是东野圭吾迄今口碑最好的长篇杰作，具备经典名著的一切要素：\n\n一宗离奇命案牵出跨度近20年步步惊心的故事：悲凉的爱情、吊诡的命运、令人发指的犯罪、复杂人性的对决与救赎……\n\n-------------------------------------------------------------------\n\n1973年，大阪的一栋废弃建筑中发现一名遭利器刺死的男子。案件扑朔迷离，悬而未决。\n\n此后20年间，案件滋生出的恶逐渐萌芽生长，绽放出恶之花。案件相关者的人生逐渐被越来越重的阴影笼罩……\n\n“我的天空里没有太阳，总是黑夜，但并不暗，因为有东西代替了太阳。虽然没有太阳那么明亮，但对我来说已经足够。\n\n凭借着这份光，我便能把黑夜当成白天。\n\n我从来就没有太阳，所以不怕失去。”\n\n“只希望能手牵手在太阳下散步”，这句象征本书故事内核的绝望念想，有如一个美丽的幌子，随着无数凌乱、压抑、悲凉的事件片段如纪录片一样一一还原，最后一丝温情也被完全抛弃，万千读者在一曲救赎罪恶的爱情之中悲切动容。', '东野圭吾\n\n日本著名作家。\n\n1985年，凭《放学后》获第31届江户川乱步奖，开始专职写作；\n\n1999年，《秘密》获第52届日本推理作家协会奖；此后《白夜行》、《单恋》、《信》、《幻夜》先后入围直木奖。\n\n2005年出版的《嫌疑人X的献身》史无前例地将第134届直木奖、第6届本格推理小说大奖，以及年度三大推理小说排行榜第1名一并斩获；\n\n2008年，《流星之绊》获第43届新风奖。\n\n2009年出版的《新参者》获两大推理小说排行榜年度第1名；\n\n2012年，《浪矢杂货店的奇迹》获第7届中央公论文艺奖。', '第一章 1\n第二章 45\n第三章 74\n第四章 113\n第五章 139\n第六章 167\n第七章 193\n第八章 220\n第九章 249\n第十章 279\n第十一章 316\n第十二章 345\n第十三章 398\n【2008那版的，应该差不多】');
INSERT INTO `book` VALUES (13, '小王子', '[法] 圣埃克苏佩里', 9.1, 750369, '人民文学出版社', '2003-08-01', '22', 's1237549.jpg', '儿童文学', '小王子是一个超凡脱俗的仙童，他住在一颗只比他大一丁点儿的小行星上。陪伴他的是一朵他非常喜爱的小玫瑰花。但玫瑰花的虚荣心伤害了小王子对她的感情。小王子告别小行星，开始了遨游太空的旅行。他先后访问了六个行星，各种见闻使他陷入忧伤，他感到大人们荒唐可笑、太不正常。只有在其中一个点灯人的星球上，小王子才找到一个可以作为朋友的人。但点灯人的天地又十分狭小，除了点灯人他自己，不能容下第二个人。在地理学家的指点下，孤单的小王子来到人类居住的地球。\n\n小王子发现人类缺乏想象力，只知像鹦鹉那样重复别人讲过的话。小王子这时越来越思念自己星球上的那枝小玫瑰。后来，小王子遇到一只小狐狸，小王子用耐心征服了小狐狸，与它结成了亲密的朋友。小狐狸把自己心中的秘密——肉眼看不见事务的本质，只有用心灵才能洞察一切——作为礼物，送给小王子。用这个秘密，小王子在撒哈拉大沙漠与遇险的飞行员一起找到了生命的泉水。最后，小王子在蛇的帮助下离开地球，重新回到他的B612号小行星上。\n\n童话描写小王子没有被成人那骗人的世界所征服，而最终找到自己的理想。这理想就是连结宇宙万物的爱，而这种爱又是世间所缺少的。因此，小王子常常流露出一种伤感的情绪。作者圣埃克絮佩里在献辞中说：这本书是献给长成了大人的从前那个孩子。\n\n《小王子》不仅赢得了儿童读者，也为成年人所喜爱，作品凝练的语言渗透了作者对人类及人类文明深邃的思索。它所表现出的讽刺与幻想，真情与哲理，使之成为法国乃至世界上最为著名的一部童话小说。', '安托万·德·圣埃克苏佩里（Antoine de Saint-Exupery, 1900-1944）1900年6月29日出生在法国里昂。他曾经有志于报考海军学院，未能如愿，却有幸成了空军的一员。1923年退役后，先后从事过各种不同的职业。\n\n1926年，圣埃克苏佩里进入拉泰科埃尔航空公司。在此期间，出版小说《南方邮件》（1929）、《夜航》（1931），从此他在文学上声誉鹊起。1939年，又一部作品《人的大地》问世。\n\n第二次世界大战期间他重入法国空军。后辗转去纽约开始流亡生活。在这期间，写出《空军飞行员》、《给一个人质的信》、《小王子》（1943）等作品。1944年返回同盟国地中海空军部队。在当年7月31日的一次飞行任务中，他驾驶飞机飞上湛蓝的天空，就此再也没有回来。', '第一卷 南渡记出版说明人物表序曲第一章 第二章第三章第四章第五章第六章第七章间曲后记第二卷 东藏记人物表……间曲后记');
INSERT INTO `book` VALUES (14, '安徒生童话故事集', '（丹麦）安徒生', 9.2, 131113, '人民文学出版社', '1997-08-01', '25', 's1034062.jpg', '儿童文学', '暂无内容简介', '安徒生是丹麦19世纪著名童话作家，世界文学童话创始人。他生于欧登塞城一个贫苦鞋匠家庭，早年在慈善学校读过书，当过学徒工。受父亲和民间口头文学影响，他自幼酷爱文学。\n\n“为了争取未来的一代”，安徒生决定给孩子写童话，出版了《讲给孩子们听的故事》。此后数年，每年圣诞节都出版一本这样的童话集。其后又不断发表新作，直到1872年因患癌症才逐渐搁笔。近40年间，共计写了童话168篇。\n\n安徒生的创作可分早、中、晚三个时期。早期童话多充满绮丽的幻想、乐观的精神，体现现实主义和浪漫主义相结合的特点。代表作有《打火匣》、《小意达的花儿》、《拇指姑娘》、《海的女儿》、《野天鹅》、《丑小鸭》等。中期童话，幻想成分减弱，现实成分相对增强。在鞭挞丑恶、歌颂善良中，表现了对美好生活的执着追求，也流露了缺乏信心的忧郁情绪。代表作有《卖火柴的小女孩》、《白雪皇后》、《影子》、《一滴水》、《母亲的故事》、《演木偶戏的人》等。晚期童话比中期更加面对现实，着力描写底层民众的悲苦命运，揭露社会生活的阴冷、黑暗和人间的不平。作品基调低沉。代表作有《柳树下的梦》、《她是一个废物》、《单身汉的睡帽》、《幸运的贝儿》等。', '第一卷\n1、打火匣\n2、皇帝的新装\n3、飞箱\n4、丑小鸭\n5、没有画的画册\n6、跳高者\n7、红鞋\n8、衬衫领子\n9、一个豆英里的五粒豆\n10、一个贵族和他的女儿们\n11、守塔人奥列\n12、蝴蝶\n13、贝脱、比脱和比尔\n14、烂布片\n15、织补针\n16、拇指姑娘\n17、跳蚤和教授\n18、区别\n19、一本不说话的书\n20、夏曰痴\n21、笔和墨水壶\n22、风车\n23、瓦尔都窗前的一起\n24、甲虫\n25、幸福的家庭\n26、最后的一天\n27、完全是真的\n28、蓟的遭遇\n29、新世纪的女神\n30、各得其所\n31、一星期的曰子\n32、钱猪\n33、在辽远的海极\n34、荷马墓上的一朵玫瑰\n35、野天鹅\n36、母亲的故事\n37、犹太女子\n38、牙痛姑妈\n39、金黄的宝贝\n40、民歌的鸟儿\n41、接骨木树妈妈\n42、沙丘的故事\n第二卷\n1、小克劳斯和大克劳斯\n2、迁居的日子\n3、鬼火进城了\n4、幸运的套鞋\n5、鹳鸟\n6、枞树\n7、香肠栓熬的汤\n8、牧羊女和扫烟囱的人\n9、亚麻\n10、天上落下来的一片叶子\n11、恶毒的王子\n12、演木偶戏的人\n13、舞吧，舞吧，我的玩偶\n14、安妮·莉斯贝\n15、素琪\n16、藏着并不等于遗忘\n17、谁是最幸运的\n18、钟声\n19、顽皮的孩子\n20、识字课本\n21、老约翰妮讲的故事\n22、老墓碑\n23、姑妈\n24、墓里的孩子\n25、老路灯\n26、老头子做事总不会错\n27、老房子\n28、天鹅的窠\n29、创造\n30、冰姑娘\n31、小鬼和小商人\n32、阳光的故事\n33、依卜和小克丽斯玎\n34、梦神\n35、老上帝还没有灭亡\n36、园丁和他的贵族主人\n37、书法家\n38、茶壶\n39、小小的绿东西\n40、一点成绩\n41、天国花园\n42、最难使人相信的事情\n43、一枚银毫\n第三卷\n1、肉肠签子汤\n2、光棍汉的睡帽\n3、做出点样子来\n4、老橡树的最后一梦\n5、字母读本\n6、沼泽王的女儿\n7、跑得飞快的东西\n8、钟渊\n9、狠毒的王子\n10、多伊和他的女儿们\n11、踩面包的姑娘\n12、守塔人奥勒\n13、安妮·莉丝贝特\n14、孩子话\n15、一串珍珠\n16、墨水笔和墨水瓶\n17、墓中的孩子\n18、家养公鸡和风信公鸡\n19、“真可爱”\n20、沙冈那边的一段故事\n21、演木偶戏的人\n22、两兄弟\n23、教堂古钟\n24、搭邮车来的十二位\n25、屎壳郎\n26、老爹做的事总是对的\n27、雪人\n28、在鸭场里\n29、新世纪的缪斯\n30、冰姑娘\n31、蝴蝶\n32、普赛克\n第四卷\n1、蜗牛和玫瑰树\n2、害人鬼进城了\n3、风磨\n4、银毫子\n5、伯尔厄隆的主教和他的亲眷\n6、在幼儿室里\n7、金宝贝\n8、狂风吹跑了招牌\n9、茶壶\n10、民歌的鸟\n11、绿色的小东西\n12、小精灵和太太\n13、贝得、彼得和皮尔\n14、隐存着并不就是被忘却\n15、看门人的儿子\n16、搬迁日\n17、谎报夏\n18、姨妈\n19、癞蛤蟆\n20、教父的画册\n21、碎布块\n22、岛和格棱岛\n23、谁最幸福\n24、树精\n25、看鸡人格瑞得的一家\n26、蓟的经历\n27、你能琢磨出什么\n28、好运气可能在一根签子里\n29、彗星\n30、一个星期的每一天\n31、阳光的故事\n32、曾祖父\n33、烛\n34、最难令人相信的事\n35、一家人都怎样说\n36、跳吧，舞吧，我的小宝宝\n37、大海蟒\n38、园丁和主人\n39、跳蚤和教授\n40、老约翰妮讲了些什么\n41、大门钥匙\n42、跛脚的孩子\n43、牙痛姨妈\n44、海的女儿\n45、邻居们\n46、夜莺');
INSERT INTO `book` VALUES (15, '撒哈拉的故事', '三毛', 9.2, 171716, '哈尔滨出版社', '2003-08-01', '15.8', 's1369343.jpg', '现代文学', '三毛作品中最脍炙人口的《撒哈拉的故事》，由12篇精彩动人的散文结合而成，其中《沙漠中的饭店》，是三毛适应荒凉单调的沙漠生活后，重新拾笔的第一篇文字，自此之后，三毛便写出一系列以沙漠为背景的故事，倾倒了全世界的中文读者。', '三毛（1943-1991），台湾作家。1943年3月26日出生于重庆，浙江省定海县人。本名为陈惠平，1946年改名陈平，笔名“三毛”。1964年入中国文化大学哲学系，肄业后曾留学欧洲，婚后定居西属撒哈拉沙漠加那利岛并以当地的生活为背景，写出一连串情感真挚的作品。1981年回到台湾，在中国文化大学任教，1984年辞去教职，专职从事写作和演讲。1991年1月4日自杀而死，终年48岁。\n\n三毛的足迹遍及世界各地，平生著作、译作十分丰富，其中《撒哈拉的故事》《雨季不再来》《哭泣的骆驼》《我的宝贝》《闹学记》《滚滚红尘》等散文、小说、剧本更是脍炙人口，在全球华人社会广为流传，在中国大陆风靡一时，影响了整整一代人。', '一 妈妈的一封信（代序）\n二 回乡小笺（四版代序）\n三 沙漠中的饭店\n四 结婚记\n五 悬壶济世\n六 娃娃新娘\n七 荒山之夜\n八 沙漠观浴记\n九 爱的寻求\n十 芳邻\n十一 素人渔夫\n十二 死果\n十三 天梯\n十四 白手成家\n三毛一生大事记');
INSERT INTO `book` VALUES (16, '天龙八部', '金庸', 9.2, 131778, '生活·读书·新知三联书店', '1994-05-01', '96', 's26018275.jpg', '武侠小说', '天龙八部乃金笔下的一部长篇小说，与《射雕》，《神雕》等 几部长篇小说一起被称为可读性最高的金庸小说。《天龙》的故事情节曲折，内容丰富，也曾多次被改编为电视作品。是金庸作品中集大成的一部。故事以北宋末年动荡的社会环境为背景，展开波澜壮阔的历史画卷，塑造了乔峰、段誉、 虚竹、慕容复等形象鲜明的人物，成为武侠史上的经典之作。故事精彩纷呈，人物命运悲壮多变，是可读性很强的作品，具有震撼人心的力量', '金庸（1924年2月6日—），香港“大紫荆勋贤”。原名查良镛(zhā liáng yōng，英：Louis Cha)，浙江海宁人，当代著名作家、新闻学家、企业家、社会活动家，《香港基本法》主要起草人之一。金庸是新派武侠小说最杰出的代表作家，被普遍誉为武侠小说作家的“泰山北斗”，更有金迷们尊称其为“金大侠”或“查大侠”。\n\n金庸生于1924年，祖籍为安徽省桐城，出生在浙江海宁，查家为当地望族，历史上最鼎盛期为清康熙年间，以查慎行为首叔侄七人同任翰林。现代查氏家族还有两位知名人物，南开大学教授查良铮（穆旦）（四十年代九叶派代表诗人，翻译家），台湾学术界风云人物、司法部长查良钊。出自海宁的著名人物还有王国维和徐志摩。徐志摩是金庸的表兄。金庸祖父查沧珊是“丹阳教案”的当事人。', '（一至十：少年游）\n青衫磊落险峰行\n玉璧月华明\n马疾香幽\n崖高人远\n微步觳纹生\n谁家子弟谁家院\n无计悔多情\n虎啸龙吟\n换巢鸾凤\n剑气碧烟横\n（十一至二十：苏幕遮 ）\n向来痴\n从此醉\n水榭听香 指点群豪戏\n剧饮千杯男儿事\n杏子林中 商略平生义\n昔时因\n今日意\n胡汉恩仇 须倾英雄泪\n虽万千人吾往矣\n悄立雁门 绝壁无余字\n（二十一至三十：破阵子）\n千里茫茫若梦\n双眸粲粲如星\n塞上牛羊空许约\n烛畔鬓云有旧盟\n莽苍踏雪行\n赤手屠熊搏虎\n金戈荡寇鏖兵\n草木残生颅铸铁\n虫豸凝寒掌作冰\n挥洒缚豪英\n（三十一至四十：洞仙歌）\n输赢成败 又争由人算\n且自逍遥没谁管\n奈天昏地暗 斗转星移\n风骤紧 缥缈峰头云乱\n红颜弹指老 刹那芳华\n梦里真真语真幻\n同一笑 到头万事俱空\n胡涂醉 情长计短\n解不了 名缰系嗔贪\n却试问 几时把痴心断\n四十一至五十、水龙吟\n燕云十八飞骑 奔腾如虎风烟举\n老魔小丑 岂堪一击 胜之不武\n王霸雄图 血海深仇 尽归尘土\n念枉求美眷 良缘安在\n枯井底 暗泥处\n酒罢问君三语\n为谁开 茶花满路\n王孙落魄 怎生消得 杨枝玉露\n敝屣荣华 浮云生死 此身何惧\n教单于折箭 六军辟易 奋英雄怒');
INSERT INTO `book` VALUES (17, '呐喊', '鲁迅', 9.2, 158255, '人民文学出版社', '1973-03-03', '36', 's34099286.jpg', '现代文学', '《呐喊》收录作者1918年至1922年所作小说十四篇。1923年8月由北京新潮社出版，原收十五篇，列为该社《文艺丛书》之一。1924年5月第三次印刷时起，改由北京北新书局出版，列为作者所编的《乌合丛书》之一。1930年1 月第十三次印刷时，由作者抽去其中的《不周山》一篇(后改名为《补天》，收入《故事新编》)。作者生前共印行二十二版次。', '鲁迅，本名周树人（1881年9月25日—1936年10月19日）。浙江绍兴人，字豫才，原名周樟寿，字豫山、豫亭。以笔名鲁迅闻名于世。鲁迅先生青年时代曾受进化论、尼采超人哲学和托尔斯泰博爱思想的影响。1904年初，入仙台医科专门学医，后从事文艺创作，希望以此改变国民精神。鲁迅先生一生写作计有600万字，其中著作约500万字，辑校和书信约100万字。作品包括杂文、短篇小说、评论、散文、翻译作品。对于“五四运动”以后的中国文学产生了深刻的影响。', '《呐喊》自序\n一件小事\n狂人日记\n鸭的喜剧\n端午节\n故乡\n孔乙己\n药\n阿Q正传\n兔和猫\n社戏\n风波\n头发的故事\n明天\n白光');
INSERT INTO `book` VALUES (18, '杀死一只知更鸟', '[美国] 哈珀·李', 9.2, 144529, '译林出版社', '2012-09-02', '32', 's23128183.jpg', '长篇小说', '成长总是个让人烦恼的命题。成长有时会很缓慢，如小溪般唱着叮咚的歌曲趟过，有时却如此突如其来，如暴雨般劈头盖脸……三个孩子因为小镇上的几桩冤案经历了猝不及防的成长——痛苦与迷惑，悲伤与愤怒，也有温情与感动。这是爱与真知的成长经典。\n\n《杀死一只知更鸟》获1961年普利策奖。\n\n美国图书馆借阅率最高的书，英国青少年最喜爱的小说之一。\n\n美国中学推荐课外读物。\n\n由小说改编的电影获第25届奥斯卡三项大奖。\n\n美国电影协会评选的“100名银幕英雄与恶人”中，派克主演的芬奇律师名列英雄第一位。\n\n作为史上最受喜爱的小说之一，《杀死一只知更鸟》已获得显赫声誉。它赢得过普利策奖，被翻译成四十多种语言，在世界范围内售出超过三千万册，并曾被拍成，备受欢迎的电影。', '哈珀•李（1926— ）\n\n生于美国阿拉巴马州， 曾被授予普利策小说奖及其他众多文学奖项。她与杜鲁门•卡坡蒂是幼年的邻居和一生的朋友。《杀死一只知更鸟》据说是以卡坡蒂为原型之一创作的，现已成为公认的美国文学经典。此后，她一直隐居在家乡亚拉巴马的小镇上 ，拒绝各种采访，过着平静的生活。有人问她为什么不在盛名之下接着写作，她回答：“有过这样一次，还有什么可写的？”', '暂无目录信息');
INSERT INTO `book` VALUES (19, '悉达多', '[德] 赫尔曼·黑塞', 9.3, 97020, '天津人民出版社', '2017-01-01', '32', 's29396368.jpg', '佛教哲理', '悉达多》并非是佛陀的故事，它讲述了一个人的一生，千万寻常人亦会经历的一生。\n\n意气风发的少年郎，常认为自己是被命运选中的人。抛下过去，随了跌跌撞撞的步伐，找寻心中的声音，追逐名利，经历友情，品尝爱情。不同的是，悉达多一生追求的是生命的圆融统一，看似宏大，确是每个人无法回 避的问题。\n\n黑塞的语言是充满诗性的，正如本书副题“一首印度的诗”，因不得而知的原因，此副题在前人所出版本中都被回避了。为了尽可能表现黑塞的诗意，我们选择从德文直译，尽管我们的译文不能完全实现这种诗意，但其诗的本性与精神显而易见。\n\n本书地位在前人的版本中已被反复强调——亨利·米勒的最爱；影响了包括电台司令在内的许多名人雅士；在六十年代美国掀起过阅读黑塞的热潮，大学生们人手一册等等。\n\n但如书中成为摆渡人的悉达多所述，智慧无法分享，它可以被发现，被体验。\n\n所以倘若你碰巧遇到了这本小书，请细细品味其中的文字。\n\n愿你在读了悉达多的故事后，也能有所感悟，并开始体验属于自己的人生。', '作者简介\n\n赫尔曼·黑塞 | Hermann Hesse\n\n（1877—1962）\n\n作家，诗人，画家。\n\n1877年生于德国，1924年入籍瑞士。\n\n1946年获诺贝尔文学奖。\n\n20世纪六十年代美国掀起过阅读黑塞的热潮。\n\n被誉为德国浪漫派的最后一位骑士。\n\n主要作品\n\n1904 《彼得·卡门青》\n\n1906 《在轮下》\n\n1913 《印度札记》\n\n1919 《德米安》\n\n1922 《悉达多》\n\n1923 《辛克莱的笔记》\n\n1925 《温泉疗养客》\n\n1927 《荒原狼》\n\n1928 《沉思录》\n\n1930 《纳尔齐斯和歌尔德蒙》\n\n1932 《东方之旅》\n\n1943 《玻璃珠游戏》', '第一部\n001 婆罗门之子 _ 012 沙门\n024 乔达摩 _ 035 觉醒\n第二部\n042 迦摩罗 _ 059 尘世间 _ 070 轮回\n079 在河边 _ 091 船夫 _ 104 儿子\n114 唵 _ 121 乔文达\n133 译后记');
INSERT INTO `book` VALUES (20, '明朝那些事儿（1-9）', '当年明月', 9.2, 171030, '中国海关出版社', '2009-04-02', '358.2', 's3745215.jpg', '历史小说', '《明朝那些事儿》讲述从1344年到1644年，明朝三百年间的历史。作品以史料为基础，以年代和具体人物为主线，运用小说的笔法，对明朝十七帝和其他王公权贵和小人物的命运进行全景展示，尤其对官场政治、战争、帝王心术着墨最多。作品也是一部明朝政治经济制度、人伦道德的演义。', '当年明月，青年历史学者，畅销书作家。专业职称为副研究员，明史学会会员。是心灵历史的开创者，担任国内多家电视台文史类节目主讲人。所著作品《明朝那些事儿》销量过五百万册，为三十年来最畅销之史学读本。', '暂无目录信息');
INSERT INTO `book` VALUES (21, '邓小平时代', '【美】傅高义 (Ezra.F.Vogel)', 9.3, 68513, '生活·读书·新知三联书店', '2013-01-18', '88', 's24516687.jpg', '历史传记', '邓小平深刻影响了中国历史和世界历史的走向，也改变了每一个当代中国人的命运。解读邓小平的政治生涯及其行为逻辑，就是解读当代中国，解读个人命运背后的历史变局。\n\n哈佛大学傅高义教授倾十年心力完成的巨著《邓小平时代》，是对邓小平跌宕起伏的一生以及中国惊险崎岖的改革开放之路的全景式描述。作者以丰富的史料、国内外重要的研究成果、档案资料和为数众多的独家访谈为基础，对邓小平个人性格及执政风格进行了深层分析，并对中国改革开放史进行了完整而独到的阐释。全书人物、事件众多，既有对毛泽东、周恩来、邓小平、陈云等人相互关系的细致解读，又有对三中全会、权力过渡、中美建交、政改试水、经济特区、一国两制、九二南巡等重大事件和决策的深入分析。全书持论严谨、脉络清晰、观点鲜明、叙述生动，力图使人物言行符合历史情境，对改革开放的历史进程亦时有独特看法，引人深思，被誉为邓小平研究“纪念碑式”的著作。\n\n读懂《邓小平时代》，读懂这段历史，读懂“仍然生活在邓小平时代”的我们自己的现在和未来。', '傅高义（EZRA F. VOGEL)，哈佛大学亨利• 福特二世社会学荣休教授，费正清东亚研究中心前主任。1930年7月出生于美国中西部的俄亥俄州的一个小镇。1950年毕业于俄亥俄州韦斯利大学。1958年获哈佛大学社会学博士学位。在1963—1964年成为哈佛的博士后，学习中文和历史；被认为是美国唯一的一位对中日两国事务都精通的学者。\n\n他1961年开始在哈佛学习中文和中古历史，在哈佛有着“中国先生”的称号。1972年他作为费正清的继任人，成为东亚研究中心的第二任主任。1998年被选入美国人文社会科学院，一直是受中国政府重视的汉学家和中国问题专家。曾撰有《日本第一》、《日本的中产阶级》、《重整旗鼓一一重建美国实例分析》等著作。70年代始，对我国广东社会经济情况进行考察和研究。撰有《共产主义制度下的广东:一个省会的规划和政治(1949-1968年）》。', '前言 探寻邓小平\n导言 这个人和他的使命\n邓小平的人生经历\n1.革命者、建设者、改革者，1904—1969\n曲折的登顶之路，1969—1977\n2.放逐与回归，1969—1974\n3.整顿，1974—1975\n4.向前看，1975\n5.靠边站，1976\n6.复出，1977—1978\n开创邓小平时代，1978—1980\n7.三个转折点，1978\n8.为自由设限，1978—1979\n9.苏联—越南的威胁，1978—1979\n10.向日本开放，1978\n11.向美国开放，1978—1979\n12.重组领导班子，1979—1980\n邓小平时代，1978—1989\n13.邓小平的统制术\n14.广东和福建的试验，1979—1984\n15.经济调整和农村改革，1978—1982\n16.加快经济发展和开放步伐，1982—1989\n17.台湾、香港以及西藏问题\n18.为军事现代化做准备\n19.政治的潮起潮落\n邓小平时代的挑战，1989——1992\n20.北京，1989\n21.稳住阵脚，1989—1992\n22 邓小平的终曲：南方之行，1992\n邓小平的历史地位\n23.转型的中国\n注释\n索引');
INSERT INTO `book` VALUES (22, '失踪的孩子', '[意] 埃莱娜·费兰特', 9.2, 79165, '人民文学出版社', '2018-07-01', '62', 's29799269.jpg', '成长小说', '“我的整个生命，只是一场为了提升社会地位的低俗斗争。”\n\n全球畅销近千万册被翻译成40多种语言\n\n《我的天才女友》《新名字的故事》《离开的，留下的》——\n\n那不勒斯四部曲NO.4令人欲罢不能的大结局\n\n穷尽友谊对一个人最极致的塑造\n\n《失踪的孩子》是“那不勒斯四部曲”的第四部，小说聚焦了莉拉和埃莱娜（“我”）的壮年和晚年，为她们持续了五十多年的友谊划上了一个令人心碎的句号。\n\n“我”为了爱情和写作，离开丈夫带着两个女儿回到了那不勒斯，不可避免地与莉拉，还有我曾想要逃离的城区再度变得亲密。“我”和莉拉甚至在同一年怀孕、生子，并经历了恐怖残暴的那不勒斯大地震，一切都分崩离析，一切又将被重建。\n\n“我”在不自觉中卷入莉拉秘密的企图——她希望利用我的名声和写作技巧来对抗城区陈腐而猖獗的恶势力。但在经历了生命最恐怖的打击之后，莉拉选择以一种怪异夸张的方式在城区彻底将自己流放。\n\n而“我”也将以惊人的韧性和诚实面对写作、爱情、家庭的失败。在经历了多年的自我怀疑之后，“我”决定忤逆（罔顾？）莉拉的告诫，将“我”和她一生的友谊写成一本小说，却招来了最深的背叛……', '埃莱娜•费兰特，目前意大利最受欢迎也最神秘的作家。埃莱娜•费兰特是一个笔名，其真实身份至今是谜。\n\n埃莱娜•费兰特1992年发表第一部长篇小说《讨厌的爱》，1995年被意大利导演马里奥•马尔托内改编为同名电影；此后她相继出版小说《被抛弃的日子》(2002)、《迷失的女儿》（2006）、《夜晚的沙滩》（2007）和散文、访谈集《不确定的碎片》（2003）。\n\n2011年至2014年，埃莱娜•费兰特以每年一本的频率出版《我的天才女友》《新名字的故事》《离开的，留下的》和《失踪的孩子》，这四部情节相关的小说被称为“那不勒斯四部曲”。它们以史诗般的体例，描述了两个在那不勒斯穷困社区出生的女孩持续半个世纪的友谊，尖锐又细腻探讨了女性命运的复杂性和深度。\n\n“那不勒斯四部曲”也在世界范围内掀起了“费兰特热”。2015年，埃莱娜•费兰特被《金融时报》评为“年度女性”。2016年，《时代》周刊将埃莱娜•费兰特选入“最具影响力的100位艺术家”。2017年3月，《我的天才女友》被改编成话剧在伦敦上演。2017年4月，HBO宣布将那不勒斯四部曲改编成系列电视剧。\n\n译者简介：\n\n陈英，意大利语言学博士，现任四川外国语大学副教授，译有《愤怒的城堡》《一个人消失在世上》《迫害》《拳头》《威尼斯是一条鱼》等。', '人物表\n壮 年\n老 年\n尾 声');
INSERT INTO `book` VALUES (23, '新名字的故事', '[意] 埃莱娜·费兰特', 9.2, 89755, '人民文学出版社', '2017-04-05', '59', 's29376146.jpg', '长篇小说', '只有你身为女人 才会知道这些丑陋的秘密\n\n两个女人 50年的友谊和战争\n\n如何成为那个更强大的她，又不被她战胜\n\n那不勒斯四部曲NO.2\n\n《我的天才女友》后续， 意大利最神秘的作家费兰特\n\n探索青年时代的激情、困惑、挣扎、背叛和失去\n\n全球畅销近千万册 被翻译成40多种语言\n\n-------------------------\n\n《新名字的故事》是埃莱娜·费兰特的“那不勒斯四部曲”的第二部，描述了埃莱娜和莉拉的青年时代。在她们的人生以最快的速度急遽分化的那些年里，她们共同体验了爱、失去、困惑、挣扎、嫉妒和隐蔽的破坏。\n\n莉拉在结婚当天就发现婚姻根本不是她想象的那样，她的初夜几乎是一场强奸。她带着一种强大的破坏欲介入了斯特凡诺的家族生意，似乎成为了她和埃莱娜小时候都想成为的那种女人。久未有身孕的莉拉，和埃莱娜去海边度假休养。而在伊斯基亚岛的那个夏天，改变了所有人的一生……\n\n出于对莉拉所拥有的爱情的愤怒，“我”（埃莱娜）奋力摆脱这个破败、暴力、充满宿仇的街区。“我”成了街区的第一个大学生，并和一个高级知识分子家庭的男孩订婚，甚至出版了第一本小说。“我”以胜利者的形象回到那不勒斯，却发现告别了丑陋婚姻的莉拉，在一家肉食加工厂备受屈辱地打工。\n\n当“我”发现自己的小说，其实完全窃取了莉拉交托给“我”的秘密笔记本里那些独特的力量和灵感，“我”被迫面临一个极度痛苦的问题：“我”和莉拉，到底谁离开了，又是谁留下了？', '埃莱娜·费兰特，目前意大利最受欢迎也最神秘的作家。埃莱娜·费兰特是一个笔名，其真实身份至今是谜。\n\n埃莱娜·费兰特1992年发表第一部长篇小说《讨厌的爱》，很快引起关注，1995年就被意大利导演马里奥·马尔托内拍摄为同名影片；此后她相继出版小说《被抛弃的日子》(2002) 、《迷失的女儿》（2006）、《夜晚的沙滩》（2007）和散文、访谈集《不确定的碎片》（2003）。\n\n2011年至2014年，埃莱娜·费兰特以每年一本的频率出版《我的天才女友》《新名字的故事》《离开的，留下的》和《失踪的孩子》这四部情节相关的小说，被称为“那不勒斯四部曲”。它们以史诗般的体例，描述了两个在那不勒斯穷困社区出生的女孩持续半个世纪的友谊。\n\n“那不勒斯四部曲”也在世界范围内掀起了“费兰特热”，千万读者为书中对女性友谊极度真实、尖锐、毫不粉饰的描述所打动。虽然作者从未公开其性别，但媒体和评论家从其“自传性”色彩强烈的写作中判断其为女性。2015年，埃莱娜·费兰特被《金融时报》评为“年度女性”。2016年，《时代》周刊将埃莱娜·费兰特选入“最具影响力的100位艺术家”。', '暂无目录信息');
INSERT INTO `book` VALUES (24, '沉默的大多数', '王小波', 9.1, 149837, '中国青年出版社', '1997-10-01', '27', 's1447349.jpg', '杂文集', '这本杂文随笔集包括思想文化方面的文章，涉及知识分子的处境及思考，社会道德伦理，文化论争，国学与新儒家，民族主义等问题；包括从日常生活中发掘出来的各种真知灼见，涉及科学与邪道，女权主义等；包括对社会科学研究的评论，涉及性问题，生育问题，同性恋问题，社会研究的伦理问题和方法问题等；包括创作谈和文论，如写作的动机，作者的师承，作者对小说艺术的看法，作者对文体格调的看法，对影视的看法等；包括少量的书评，其中既有对文学经典的评论，也有对当代作家作品的一些看法；最后，还包括一些域外生活的杂感以及对某些社会现象的评点。', '王小波（1952-1997），男。汉族。当代著名学者、作家。他的代表作品有《黄金时代》、《白银时代》、《黑铁时代》等。被誉为中国的乔伊斯兼卡夫卡。他的唯一一部电影剧本《东宫西宫》获阿根廷国际电影节最佳编剧奖，并且入围1997年的戛纳国际电影节。', '序言\n1 沉默的大多数\n2 思维的乐趣\n3 中国知识分子与中古遗风\n4 知识分子的不幸\n5 花刺子模信使问题\n6 积极的结论\n7 跳出手掌心\n8 道德堕落与知识分子\n9 论战与道德\n10 道德保守主义及其他\n11 我看文化热\n12 文化之争\n13 “行货感”与文化相对主义\n14 极端体验\n……\n后记\n再版后记');
INSERT INTO `book` VALUES (25, '野草', '鲁迅', 9.5, 46365, '人民文学出版社', '1973-03-03', '20', 's34099301.jpg', '现代文学', '本书所收散文诗23篇〔包括一首打油诗和一出诗剧〕，最初都曾陆续发表于1924年12月至1926年1月的《语丝》周刊上，《题辞》最初也曾发表于1927年7月2日出版的《语丝》第138期，发表时署名均为鲁迅。\n\n本书于于年1927年4月由作者亲自编定，同年7月由上海北新书局初版印行列为作者所编的《乌合丛书》之一。此后印行的版本，除个别字和标点有所不同外，各篇文字大都和初版相同。《题辞》在本书最初的几次印刷都曾印入；后来被国民党政府书报检查机关抽去〔鲁迅在1935年11月23日致邱遇信和1936年2月19日致夏传经信中，均提及此事〕，至1941年上海鲁迅全集出版社出版《鲁迅三十年集》时才重新收入。《野草》的封面画系孙福熙所作，初版封面题字署“鲁迅先生”，后按鲁迅意思改为“鲁迅著”，鲁迅在1927年12月9日夜致章廷谦信中曾提及此事。\n\n鲁迅写作《野草》时，适值“五四”退潮，正如作者在《〈自选集〉自序》〔《南腔北调集》〕中所说：“后来《新青年》的团体散掉了，有的高升，有的退隐，有的前进，我又经验了一回同一战阵中的伙伴还是会这么变化”，在这种情况下，“有了小感触，就写些短文，夸大点说，就是散文诗，以后印成一本，谓之《野草》。”编成本书的时候，如《题辞》篇末所记，正在蒋介石发动“四·一二”清党的稍后。\n\n关于本书各篇作品，作者在1931年曾为本书的英译本写过一篇短序，作了一些说明，收在《二心集》中。在1934年10月9日致萧军信中，鲁迅谈到《野草》时说：“我的那本《野草》，技术不算坏，但心情太颓唐了，因为那是我碰了许多钉子之后写出来的”。在《华盖集续编·海上通信》中说：“至于《野草》，此后做不做很难说，大约是不见得再做了，省得人来谬托知己，舐皮论骨，什么是‘入于心’的。”', '鲁迅，本名周树人（1881年9月25日—1936年10月19日）。浙江绍兴人，字豫才，原名周樟寿，字豫山、豫亭。以笔名鲁迅闻名于世。鲁迅先生青年时代曾受进化论、尼采超人哲学和托尔斯泰博爱思想的影响。1904年初，入仙台医科专门学医，后从事文艺创作，希望以此改变国民精神。鲁迅先生一生写作计有600万字，其中著作约500万字，辑校和书信约100万字。作品包括杂文、短篇小说、评论、散文、翻译作品。对于“五四运动”以后的中国文学产生了深刻的影响。', '题辞\n秋夜\n影的告别\n求乞者\n我的失恋\n复仇\n复仇（其二）\n希望\n雪\n风筝\n好的故事\n过客\n死火\n狗的驳诘\n失掉的好地狱\n墓碣文\n颓败线的颤动\n立论\n死后\n这样的战士\n聪明人和傻子和奴才\n腊叶\n淡淡的血痕中\n一觉');
INSERT INTO `book` VALUES (26, '中国历代政治得失', '钱穆', 9.2, 71467, '生活·读书·新知三联书店', '2001-01-01', '12', 's1319205.jpg', '历史小说', '《中国历代政治得失》为作者的专题演讲合集，分别就中国汉、唐、宋、明、清五代的政府组织、百官职权、考试监察、财经赋税、兵役义务等种种政治制度作了提要勾玄的概观与比照，叙述因革演变，指陈利害得失。既高屋建瓴地总括了中国历史与政治的精要大义，又点明了近现代国人对传统文化和精神的种种误解。言简意赅，语重心长，实不失为一部简明的“中国政治制度史”。', '钱穆（1895-1990年），字宾四，著名历史学家，江苏无锡人。1912年始为乡村小学教师，后历中学而大学，先后在燕京大学、北京大学、清华大学、西南联合大学等数校任教。1949年只身去香港，创办新亚书院，1967年起定居台湾。', '序\n前言\n第一讲汉代\n一、汉代政府组织\n甲、皇室与政府\n乙、中央政府的组织\n丙、汉代地方政府\n丁、中央与地方之关系\n二、汉代选举制度\n三、汉代经济制度\n四、汉代兵役制度\n五、汉制得失检讨\n第二讲唐代\n一、唐代政府组织\n甲、汉唐相权之比较\n乙、唐代中央政府三省职权之分配\n丙、中央最高机构政事堂\n丁、尚书省与六部\n戊、唐代地方政府\n己、观察使与节度使\n二、唐代考试制度\n甲、魏晋南北朝时代之九品中正制\n乙、唐代之科举\n三、唐代经济制度\n甲、唐代的租府调制\n乙、唐代账籍制度\n丙、唐代的两税制\n丁、汉唐经济财政之比较\n四、唐代兵役制度\n五、唐代制度综述\n第三讲宋代\n一、宋代政府组织\n甲、宋代中央政府\n乙、相权之分割\n丙、君权之侵揽\n丁、谏垣与政府之水火\n戊、宋代地方政府\n二、宋代考试制度\n三、宋代赋税制度\n四、宋代兵役制度与国防弱点\n第四讲明代\n一、明代的政府组织\n甲、明代之中央政府\n乙、明代内阁制度\n丙、明代地方政府\n丁、元明以下之省区制度\n戊、明代地方之监司官与督抚\n己、明清两代之胥史\n二、明代考试制度\n甲、进士与翰林院\n乙、八股文\n三、明代赋税制度\n四、明代兵制\n第五讲清代\n一、制度与法术\n二、清代的部族政权\n三、清代部族政权下的政府\n甲、清代中央政府\n子、清代的军机处\n丑、清代的六部尚书\n乙、清代地方政府\n丙、清代的各禁区\n四、部族政权下之考试制度\n五、清代的统制政策\n六、民众的反抗运动\n七、变法与革命\n总论');
INSERT INTO `book` VALUES (27, '局外人', '[法] 阿尔贝·加缪', 9.1, 236311, '上海译文出版社', '2010-08-01', '22', 's4468484.jpg', '中篇小说', '《局外人》是法国作家加缪的成名作，同时也是存在主义文学的杰出作品之一，该书以一种客观记录式的“零度风格”，粗线条地描述了主人公默尔索在荒谬的世界中经历的种种荒谬的事，以及自身的荒诞体验。从参加母亲的葬礼到偶然成了杀人犯，再到被判处死刑，默尔索似乎对一切都无动于衷，他像一个象征性的符号，代表了一种普遍的存在，又像是一个血红色的灯塔，具有高度的警示性。然而，局外人现象的产生无疑是由这个世界本身所孕育的，默尔索的存在有其深刻的外部原因。', '阿尔贝·加缪（Albert Camus，1913—1960），法国声名卓著的小说家、散文家和剧作家，“存在主义”文学的大师。1957年因“热情而冷静地阐明了当代向人类良知提出的种种问题”而获诺贝尔文学奖，是有史以来最年轻的诺奖获奖作家之一。加缪在他的小说、戏剧、随笔和论著中深刻地揭示出人在异己的世界中的孤独、个人与自身的日益异化，以及罪恶和死亡的不可避免，但他在揭示出世界的荒诞的同时却并不绝望和颓丧，他主张要在荒诞中奋起反抗，在绝望中坚持真理和正义，他为世人指出了一条基督教和马克思主义以外的自由人道主义道路。他直面惨淡人生的勇气，他“知其不可而为之”的大无畏精神使他在第二次世界大战之后不仅在法国，而且在欧洲并最终在全世界成为他那一代人的代言人和下一代人的精神导师。', '暂无目录信息');
INSERT INTO `book` VALUES (28, '人类简史', '[以色列] 尤瓦尔·赫拉利', 9.1, 197604, '中信出版社', '2014-11-01', '68', 's27814883.jpg', '历史小说', '十万年前，地球上至少有六种不同的人\n\n但今日，世界舞台为什么只剩下了我们自己？\n\n从只能啃食虎狼吃剩的残骨的猿人，到跃居食物链顶端的智人，\n\n从雪维洞穴壁上的原始人手印，到阿姆斯壮踩上月球的脚印，\n\n从认知革命、农业革命，到科学革命、生物科技革命，\n\n我们如何登上世界舞台成为万物之灵的？\n\n从公元前1776年的《汉摩拉比法典》，到1776年的美国独立宣言，\n\n从帝国主义、资本主义，到自由主义、消费主义，\n\n从兽欲，到物欲，从兽性、人性，到神性，\n\n我们了解自己吗？我们过得更快乐吗？\n\n我们究竟希望自己得到什么、变成什么？', '尤瓦尔·赫拉利，1976年生，牛津大学历史学博士，现为耶路撒冷希伯来大学的历史系教授，青年怪才，全球瞩目的新锐历史学家。\n\n他擅长世界历史和宏观历史进程研究。在学术领域和大众出版领域都有很大的兴趣。\n\n他的《人类简史》一书让他一举成名，成为以色列超级畅销书，目前这本书已授20多个国家版权，在历史学之外，人类学、生态学、基因学等领域的知识信手拈来，根据图书改变的课程上传YOUTUBE后风靡全球，拥有大批青年粉丝。写书，视频课程之外，他还开设有专栏。', '推荐序 高毅\n第一部分 认知革命\n1. 人类：一种也没什么特别的动物\n2. 知善恶树\n3. 亚当和夏娃的一天\n4. 毁天灭地的人类洪水\n第二部分 农业革命\n5. 史上最大骗局\n6. 盖起金字塔\n7. 记忆过载\n8. 历史从无正义\n第三部分 人类的融合统一\n9. 历史的方向\n10. 金钱的味道\n11. 帝国的愿景\n12. 宗教的法则\n13. 成功的秘密\n第四部分 科学革命\n14. 发现自己的无知\n15. 科学与帝国的联姻\n16. 资本主义教条\n17. 工业的巨轮\n18. 一场永远的革命\n19. 从此过着幸福快乐的日子\n20. 智人末日\n后记：变成神的这种动物\n参考书目');
INSERT INTO `book` VALUES (29, '白鹿原', '陈忠实', 9.2, 105497, '人民文学出版社', '2012-09-01', '39', 's28111905.jpg', '长篇小说', '在从清末民初到建国之初的半个世纪里，一阵阵狂风掠过了白鹿原上空，而每一次的变动都震荡着它的内在结构：打乱了再恢复，恢复了再打乱，细腻地反映出白姓和鹿姓两大家族祖孙三代的恩怨纷争。陈忠实先生在这里，人物的命运是纵线，百回千转，社会历史的演进是横面，愈拓愈宽，传统文化的兴衰则是全书的精神主体，以至人、社会历史、文化精神三者之间相互激荡，相互作用，共同推进了作品的时空，在我们眼前铺开了一轴恢宏的、动态的、极富纵深感的关于我们民族灵魂的现实主义的画卷。', '陈忠实，1942年生于西安市灞桥区，1965年初发表散文处女作，1979年加入中国作家协会。作品《信任》获1979年全国短篇小说奖，《渭北高原，关于一个人的记忆》获1990-1991全国报告文学奖，长篇小说《白鹿原》获第四届茅盾文学奖（1998）。曾任中国作家协会副主席、陕西省作协主席。现为陕西省作协名誉主席。', '白鹿原\n附录：《白鹿原》创作手记（摘录）');
INSERT INTO `book` VALUES (30, '平凡的世界（全三部）', '路遥', 9.0, 322062, '人民文学出版社', '2005-01-01', '64', 's1144911.jpg', '现实主义', '《平凡的世界》是一部现实主义小说，也是一部小说形式的家族史。作者浓缩了中国西北农村的历史变迁过程，在小说中全景式地表现了中国当代城乡的社会生活。在近十年的广阔背景下，通过复杂的矛盾纠葛，刻划社会各阶层众多普通人的形象。劳动与爱情，挫折与追求，痛苦与欢乐，日常生活与巨大社会冲突，纷繁地交织在一起，深刻地展示了普通人在大时代历史进程中所走过的艰难曲折的道路。', '路遥（1949年—1992年），陕西清涧人。1973年入延安大学中文系学习。1976年大学毕业后，先后在《陕西文艺》和《延河》杂志做编辑工作。1978年开始发表作品。著有长篇小说《平凡的世界》，中篇小说《惊心动魄的一幕》《人生》等。曾任陕西省作家协会副主席。', '暂无目录信息');
INSERT INTO `book` VALUES (31, '乡土中国', '费孝通', 9.2, 88270, '上海人民出版社', '2006-04-01', '38', 's1762210.jpg', '纪实文学', '著名社会学家费孝通教授，一生行行重行行，实地调查和考察总结中国农村经济发展的各种模式，写下了诸多不朽篇章。本书推出的是学界共认的中国乡土社会传统文化和社会结构理论研究的代表作《乡土中国》、《生育制度》、《乡土重建》和《皇权与绅权》四篇著作，可供社会学工作或教学、研究者参考。', '费孝通（1910.11～2005.4）生于江苏吴江县城。1920年入振华女校（今苏州第十中学）。1928年夏天毕业于苏州东吴大学第一附属高中，秋天入东吴大学医预科。1930年入燕京大学社会学系，获学士学位。1933年考入清华大学社会学及人类学系，获硕士学位。1936年秋入英国伦敦经济学院攻读人类学，获哲学博士学位。1938年秋回国，任教于云南大学社会学系。1940-1945年任云南大学社会学系教授，并主持云南大学社会学系研究室工作。1945-1952年任清华大学副教务长、社会学教授。1952-1957年任中央民族学院副院长、人类学教授。1980-1985年任中国社会科学院社会学研究所所长。1985年起任北京大学社会学人类学研究所所长、社会学人类学教授。作为社会活动家，曾担任民盟中央主席、全国政协副主席、全国人大常委会副委员长等职务。1980年接受国际应用人类学会颁发的马林诺斯基名誉奖；1981年获英国皇家人类学会颁发的赫胥黎奖章；1988年在联合国接受1988年“大英百科全书”奖；1993年获日本亚洲文化奖；1994年接受菲律宾马克赛赛社区领袖奖。', '重刊序言\n乡土本色\n文字下乡\n再论文字下乡\n差序格局\n维系着私人的道德\n家族\n男女有别\n礼治秩序\n无讼\n无为政治\n长老统治\n血缘和地缘\n名实的分离\n从欲望到需要\n后记\n皇权与绅权\n论绅士\n论“知识阶级“\n论师儒\n后记\n乡土重建\n中国社会变迁中的文化结症\n乡村·市镇·都会\n论城·市·镇\n不是崩溃而是瘫痪\n基层行政的僵化\n再论双轨政治\n损蚀冲洗下的乡土\n黎民不饥不寒的小康水准\n地主阶层面临考验\n现代工业技术的下乡\n分散在乡村里的小型工厂\n乡土工业的新形式\n自力更生的重建资本\n节约储蓄的保证\n对于各家批评的总答复（后记）\n生育制度\n派与汇（汇序） 潘光旦\n第一章 种族绵续的保障\n第二章 双系抚育\n第三章 婚姻的确立\n第四章 内婚和外婚\n第五章 夫妇的配合\n第六章 社会结构中的基本三角\n第七章 居处的聚散\n第八章 父母的权力\n第九章 世代间的隔膜\n第十章 社会性的断乳\n第十一章 社会继替\n第十二章 世代参差\n第十三章 单系偏重\n第十四章 以多继少\n第十五章 续绝\n第十六章 亲属扩展\n编后语');
INSERT INTO `book` VALUES (32, '围城', '钱锺书', 9.0, 445025, '人民文学出版社', '1991-02-02', '19', 's1070222.jpg', '长篇小说', '《围城》是钱钟书所著的长篇小说。第一版于1947年由上海晨光出版公司出版。1949年之后，由于政治等方面的原因，本书长期无法在中国大陆和台湾重印，仅在香港出现过盗印本。1980年由作者重新修订之后，在中国大陆地区由人民文学出版社刊印。此后作者又曾小幅修改过几次。《围城》 自从出版以来，就受到许多人的推崇。由于1949年后长期无法重印，这本书逐渐淡出人们的视野。1960年代，旅美汉学家夏志清在《中国现代小说史》(A History of Modern Chinese Fiction)中对本书作出很高的评价，这才重新引起人们对它的关注。人们对它的评价一般集中在两方面，幽默的语言和对生活深刻的观察。从1990年代开始，也有人提出对本书的不同看法，认为这是一部被“拔高”的小说，并不是一部出色的作品。很多人认为这是一部幽默作品。除了各具特色的人物语言之外，作者夹叙其间的文字也显着机智与幽默。这是本书的一大特色。也有人认为这是作者卖弄文字，语言显得尖酸刻薄。但这一说法并不为大多数人接受。', '钱钟书(1910－1998)，字哲良，默存，号槐聚，中国江苏无锡人，中国近代著名作家、 文学研究家。毕业于清华大学外文系，获文学学士，赴上海，到光华大学任教。后考取第三届(1935年)庚子赔款公费留学资格，名列榜首，留学英国牛津大学 埃克塞特学院。大学毕业后任教于多所高校。新中国成立后被评为一级教授。晚年就职于中国社会科学院，任副院长。其夫人杨绛也是著名作家，育有一女钱媛(1937年-1997年)。曾为《毛泽东选集》英文版翻译小组成员。1998年逝世，享年88岁。', '序\n围城\n附录 记钱钟书与《围城》');
INSERT INTO `book` VALUES (33, '笑傲江湖（全四册）', '金庸', 9.1, 110860, '生活·读书·新知三联书店', '1994-05-01', '76.8', 's2157335.jpg', '武侠小说', '《笑傲江湖》是金庸1967年写的一部武侠小说，属于金庸的后期作品。', '金庸本名查良镛，浙江海宁人，1924年生。上海东吴法学院毕业，知名学者、文学家、社会活动家，也是华人世界有成就的老报人。于一1959年在香港亲手创办明报机构，出版报纸、杂志和图书，一九九三年退休。先后创作了十五部长篇及短篇小说，广受当代读者欢迎，至今已蔚为全球华人的共同语言，堪称中国武侠文学的经典之作，其中若干部小说已译成英文、日文、法文、泰文、越文、马来文及朝鲜文等在海外出版发行。曾获颂众多荣衔，包括2000年获香港特别行政区颁授最高荣誉大紫荆勋章，先后获香港大学、香港理工大学、香港公开大学、加拿大英属哥伦比亚大学和日本创价大学授以博士学位，并获得香港大学、加拿大英属哥伦比亚大学、北京大学、浙江大学、苏州大学、南开大学、台北清华大学聘任为名誉教授，以及英国牛津大学圣安东尼学院、慕莲学院，英国剑桥大学鲁宾森学院及李约瑟研究院，澳洲墨尔本大学和新加坡东亚研究所选为荣誉院士，同时还担任浙江大学人文学院院长、教授、博士生导师，英国牛津大学汉学研究院高级研究员。', '第一章　灭门\n第二章　聆秘\n第三章　救难\n第四章　坐斗\n第五章　治伤\n第六章　洗手\n第七章　授谱\n第八章　面壁\n第九章　邀客\n第十章　传剑\n第十一章　聚气\n第十二章　围攻\n第十三章　学琴\n第十四章　论杯\n第十五章　灌药\n第十六章　注血\n第十七章　倾心\n第十八章　联手\n第十九章　打赌\n第二十章　入狱\n第二十一章　囚居\n第二十二章　脱困\n第二十三章　伏击\n第二十四章　蒙冤\n第二十五章　闻讯\n第二十六章　围寺\n第二十七章　三战\n第二十八章　积雪\n第二十九章　掌门\n第三十章　密议\n第三十一章　绣花\n第三十二章　并派\n第三十三章　比剑\n第三十四章　夺帅\n第三十五章　复仇\n第三十六章　伤逝\n第三十七章　迫娶\n第三十八章　聚歼\n第三十九章　拒盟\n第四十章　曲谐\n后记');
INSERT INTO `book` VALUES (34, '彷徨', '鲁迅', 9.3, 64418, '人民文学出版社', '1973-03-02', '37', 's34099293.jpg', '短篇小说', '《彷徨》收入鲁迅1924年至1925年所作的小说，首篇《祝福》写于1924年2月16日，末篇《离婚》写于1925年11月6日，实际的时间跨度是一年半多，1926年由北京北新书局出版，列为作者所编的《乌合丛书》之一。此后印行的版本都与初版同。\n\n书的扉页，有作者的题记：\n\n朝发轫于苍梧兮，夕余至乎县圃；欲少留此灵琐兮，日忽忽将其暮。\n\n吾令羲和弭节兮，望崦嵫而勿迫；路漫漫其修远兮，吾将上下而求索。\n\n《彷徨》鲁迅先生写作于“五·四”运动后新文化阵营分化的时期。原来参加过新文化运动的人，“有的退隐，有的高升，有的前进”，鲁迅当时象布不成阵的游勇那样“孤独”和 “彷徨”。《彷徨》表现了他在这一时期在革命征途上探索的心情。', '鲁迅，本名周树人（1881年9月25日—1936年10月19日）。浙江绍兴人，字豫才，原名周樟寿，字豫山、豫亭。以笔名鲁迅闻名于世。鲁迅先生青年时代曾受进化论、尼采超人哲学和托尔斯泰博爱思想的影响。1904年初，入仙台医科专门学医，后从事文艺创作，希望以此改变国民精神。鲁迅先生一生写作计有600万字，其中著作约500万字，辑校和书信约100万字。作品包括杂文、短篇小说、评论、散文、翻译作品。对于“五四运动”以后的中国文学产生了深刻的影响。', '《祝福》\n\n《在酒楼上》\n\n《幸福的家庭》\n\n《肥皂》\n\n《长明灯》\n\n《示众》\n\n《高老夫子》\n\n《孤独者》\n\n《伤逝》\n\n《弟兄》\n\n《离婚》');
INSERT INTO `book` VALUES (35, '罗杰疑案', '阿加莎·克里斯蒂', 9.2, 71766, '新星出版社', '2013-03-03', '28', 's25814002.jpg', '悬疑推理', '金斯艾伯特村里坐落着两座豪宅，“皇家围场”是其中之一，而居住其中的弗拉尔斯太太刚刚过世。\n\n此后不久，她的情人，也就是住在另一所大宅里的罗杰•艾克罗伊德先生便得知，弗拉尔斯太太一年前杀害了自己的丈夫，最终因愧疚而自杀。更重要的是，罗杰还发现她在死之前一直被一个神秘人敲诈。他展开她最后的来信，打算读出那个人的名字，可惜没有人听到。\n\n因为一把短剑插进了他的后颈……', '无可争议的侦探小说女王，侦探文学史上最伟大的作家之一。\n\n阿加莎·克里斯蒂原名为阿加莎·玛丽·克拉丽莎·米勒，一八九○年九月十五日生于英国德文郡托基的阿什菲尔德宅邸。她几乎没有接受过正规的教育，但酷爱阅读，尤其痴迷于歇洛克·福尔摩斯的故事。\n\n第一次世界大战期间，阿加莎·克里斯蒂成了一名志愿者。战争结束后，她创作了自己的第一部侦探小说《斯泰尔斯庄园奇案》。几经周折，作品于一九二○正式出版，由此开启了克里斯蒂辉煌的创作生涯。一九二六年，《罗杰疑案》由哈珀柯林斯出版公司出版。这部作品一举奠定了阿加莎·克里斯蒂在侦探文学领域不可撼动的地位。之后，她又陆续出版了《东方快车谋杀案》、《ABC 谋杀案》、《尼罗河上的惨案》、《无人生还》、《阳光下的罪恶》等脍炙人口的作品。时至今日，这些作品依然是世界侦探文学宝库里最宝贵的财富。根据她的小说改编而成的舞台剧《捕鼠器》，已经成为世界上公演场次最多的剧目；而在影视改编方面，《东方快车谋杀案》为英格丽·褒曼斩获奥斯卡大奖，《尼罗河上的惨案》更是成为了几代人心目中的经典。\n\n阿加莎·克里斯蒂的创作生涯持续了五十余年，总共创作了八十部侦探小说。她的作品畅销全世界一百多个国家和地区，累计销量已经突破二十亿册。她创造的小胡子侦探波洛和老处女侦探马普尔小姐为读者津津乐道。阿加莎·克里斯蒂是柯南·道尔之后最伟大的侦探小说作家，是侦探文学黄金时代的开创者和集大成者。一九七一年，英国女王授予克里斯蒂爵士称号，以表彰其不朽的贡献。\n\n一九七六年一月十二日，阿加莎·克里斯蒂逝世于英国牛津郡沃灵福德家中，被安葬于牛津郡的圣玛丽教堂墓园，享年八十五岁。', '第一章 谢泼德医生的早餐\n第二章 金斯艾伯特众生相\n第三章 种西葫芦的人\n第四章 芬利庄园的晚宴\n第五章 谋杀\n第六章 突尼斯短剑\n第七章 邻居的职业\n第八章 拉格伦警督胸有成竹\n第九章 金鱼池\n第十章 客厅女仆\n第十一章 波洛登门拜访\n第十二章 家庭会议\n第十三章 鹅毛管\n第十四章 艾克罗伊德太太\n第十五章 杰弗里·雷蒙德\n第十六章 麻将夜\n第十七章 帕克\n第十八章 查尔斯·肯特\n第十九章 弗洛拉·艾克罗伊德\n第二十章 拉塞尔小姐\n第二十一章 消息见报\n第二十二章 厄休拉的证词\n第二十三章 嫌疑人齐聚一堂\n第二十四章 拉尔夫·佩顿之谜\n第二十五章 全部真相\n第二十六章 云开雾散\n第二十七章 自白书');
INSERT INTO `book` VALUES (36, '肖申克的救赎', '[美] 斯蒂芬·金', 9.1, 120438, '人民文学出版社', '2006-07-05', '29.9', 's4007145.jpg', '中篇小说', '这本书收入斯蒂芬·金的四部中篇小说，是他作品中的杰出代表作。其英文版一经推出，即登上《纽约时报》畅销书排行榜的冠军之位，当年在美国狂销二十八万册。目前，这本书已经被翻译成三十一种语言，同时创下了收录的四篇小说中有三篇被改编成轰动一时的电影的记录。\n\n其中最为著名是曾获奥斯卡奖七项提名、被称为电影史上最完美影片的《肖申克救赎》（又译《刺激一九九五》）。这部小说展现了斯蒂芬·金于擅长的惊悚题材之外的过人功力。书中的另两篇小说《纳粹高徒》与《尸体》拍成电影后也赢得了极佳的口碑。其中《尸体》还被视为斯蒂芬·金最具自传色彩的作品。', '斯蒂芬·金（Stephen King），当代惊悚小说之王，通俗小说大师。他1947年9月21日出生于美国缅因州的波特兰一贫困家庭。在州立大学学习英国文学，毕业后因工资菲薄而走上写作道路。70年代中期声名渐起。自80年代至90年代以来，历年的美国畅销书排行榜，他的小说总是名列榜首，久居不下。斯蒂芬·金是在当今世界读者最多的美国小说家。他的作品超越于传统的恐怖小说，惯于通过对事件气氛的营造来震慑读者。', '他先是喜欢写作，然后赚到了钱（代序）\n——略谈斯蒂芬·金的创作生涯\n春天的希望 肖申克的救赎\n夏日沉沦 纳粹高徒\n不再纯真的秋天 尸体\n暮冬重生 呼-吸-呼-吸\n后记');
INSERT INTO `book` VALUES (37, '我与地坛', '史铁生', 9.2, 105994, '春风文艺出版社', '2002-05-05', '25', 's1151479.jpg', '哲思抒情', '收有“午餐半小时”、“我的遥远的清平湾”、“命若琴弦”、“第一人称”、“两个故事”等15篇史铁生的代表作。', '史铁生，1951年生于北京。1967年初中毕业。1969年去陕北农村插队，三年后双腿瘫痪转回北京。回京后在一家街道工厂做临时工，七年后因病情加重回家疗养。1979年始有小说、散文、剧本等作品发表。主要作品有：短篇小说《我的遥远的清平湾》、《命若琴弦》、《老屋小记》；散文《我与地坛》、《好运设计》、《病隙碎笔》；中篇小说《关于詹牧师的报告文学》、《中篇1或短篇4》；长篇小说《务虚笔记》、《我的丁一之旅》等。', '编辑例言\n前言\n1 午餐半小时\n2 我的遥远的清平湾\n3 关于詹牧师的报告文学\n4 命若琴弦\n5 毒药\n6 原罪・宿命\n7 第一人称\n8 老屋小记\n9 我与地坛\n10 墙下短记\n11 好运设计\n12 病隙碎笔（5）\n13 两个故事\n14 往事\n15 记忆与印象');
INSERT INTO `book` VALUES (38, '献给阿尔吉侬的花束', '[美] 丹尼尔·凯斯', 9.1, 104884, '广西师范大学出版社', '2015-04-05', '36', 's28050760.jpg', '科幻小说', '声称能改造智能的科学实验在白老鼠阿尔吉侬身上获得了突破性的进展，下一步急需进行人体实验。个性和善、学习态度积极的心智障碍者查理·高登成为最佳人选。手术成功后，查理的智商从68跃升为185，然而那些从未有过的情绪和记忆也逐渐浮现。', '丹尼尔·凯斯（Daniel Keyes，1927—2014）出生于纽约，拥有布鲁克林大学心理学学位。1950年代早期进入《漫威科幻故事杂志》（Marvel Science Stories）工作，随后转换跑道，成为时装摄影师与中学教师。后获得布鲁克林大学英美文学学位。\n\n1959年，凯斯在《奇幻与科幻杂志》首度发表短篇处女作《献给阿尔吉侬的花束》，赢得雨果奖的肯定，1966年扩展成长篇后又再荣获该年度星云奖，一举囊括了科幻小说最重要的两项大奖。这部探讨心智障碍主角查理·高登与白老鼠阿尔吉侬在医疗介入后，身体与心理变化的作品，曾三次改编为电影，首部改编电影《查理》（Charley）男主角克里夫·罗伯逊拿下奥斯卡最佳男主角奖的殊荣。日本NHK电视台也在2003年改编成电视剧《献花给仓鼠》，法国、波兰与英国则先后改编成舞台剧。第二次改编的最新日剧由野岛伸司编剧，于2015年4月播映。\n\n在《献给阿尔吉侬的花束》大获成功之后，凯斯又陆续推出了《第5位莎莉》、《24个比利》、《比利战争》及回忆录《阿尔吉侬、查理与我》等作品，其中《第5位莎莉》与《24个比利》均以探讨多重人格障碍为主题，也使得凯斯成为读者心目中最擅长以医疗背景描写人类心理的作家。《24个比利》也由美国华纳电影公司改编成电影《拥挤的房间》（The Crowded Room）。\n\n凯斯的作品在全球已翻译成三十种以上语言，销量超过600万本。1988年，布鲁克林大学颁发荣誉校友奖章给凯斯；2000年，美国科幻协会则颁发“终身荣誉作家奖”，以表扬他在科幻小说上的卓越成就。2014年6月15日，凯斯因肺炎并发症在佛罗里达州南部的家中过世。', '近步抱告─ 1..................001\n近步抱告─ 2..................002\n近步抱告─ 3..................004\n近步抱告─ 4..................006\n近步抱告─ 5..................010\n近步抱告─ 6..................013\n进步报告─ 7..................015\n进步报告─ 8..................020\n进步报告─ 9..................035\n进步报告─ 10 ...............058\n进步报告─ 11 ...............073\n进步报告─ 12 ...............107\n进步报告─ 13 ...............124\n进步报告─ 14 ...............154\n进步报告─ 15 ...............199\n进步报告─ 16 ...............205\n进步报告─ 17 ...............256');
INSERT INTO `book` VALUES (39, '许三观卖血记', '余华', 9.2, 158136, '作家出版社', '2012-09-09', '24', 's24575140.jpg', '长篇小说', '《许三观卖血记》是余华1995年创作的一部长篇小说。《许三观卖血记》以博大的温情描绘了磨难中的人生，以激烈的故事形式表达了人在面对厄运时求生的欲望。小说讲述了许三观靠着卖血渡过了人生的一个个难关，战胜了命运强加给他的惊涛骇浪，而当他老了，知道自己的血再也没有人要时，精神却崩溃了。', '余华，1960年4月3日生于浙江杭州，3岁时随父母迁至海盐，在海盐读完小学和中学。曾经从事过5年的牙医工作，1983年开始写作，已经完成长篇小说4部，中短篇小说集6部，随笔集3部，其作品被翻译成二十多种文字，在近三十个国家出版。曾获意大利格林扎纳•卡佛文学奖（1998年）、法国文学和艺术骑士勋章（2004年）、中华图书特殊贡献奖（2005年）、法国国际信使外国小说奖（2008年）等。', '中文版（再版）自序\n韩文版自序\n德文版自序\n意大利文版自序\n许三观卖血记\n外文版评论摘要');
INSERT INTO `book` VALUES (40, '东方快车谋杀案', '[英] 阿加莎·克里斯蒂', 9.1, 138143, '人民文学出版社', '2006-05-05', '18', 's1765799.jpg', '侦探小说', '午夜过后，一场大雪迫使东方快车停了下来。这辆豪华列车整年都处于满员状态。但那天早上却发现少了一名乘客。一个美国人死在了他的包厢里，他被刺了十二刀，可他包厢的门却是反锁着的。\n\n随着紧张气氛逐渐增强，侦探赫尔克里·波洛想出了两个侦破此案的方法……', '阿加莎·克里斯蒂被誉为举世公认的侦探推理小说女王。她的著作英文版销售量逾10亿册，而且还被译成百余种文字，销售量亦逾10亿册。她一生创作了80部侦探小说和短篇故事集，19部剧本，以及6部以玛丽·维斯特麦考特的笔名出版的小说。著作数量之丰仅次于莎士比亚。\n\n阿加莎·克里斯蒂的第一部小说《斯泰尔斯庄园奇案》写于第一次世界大战末，战时她担任志愿救护队员。在这部小说中她塑造了一个可爱的小个子比利时侦探赫尔克里·波格，成为继福尔摩斯之后侦探小说中最受读者欢迎的侦探形象。1926年，阿加莎·克里斯蒂写出了自己的成名作《罗杰疑案》（又译作《罗杰·艾克罗伊德谋杀案》）。1952年她最著名的剧本《捕鼠器》被搬上舞台，此后连续上演，时间之长久，创下了世界戏剧史上空前的纪录。\n\n1971年，阿加莎·克里斯蒂得英国女王册封的女爵士封号。1975年，英格丽·褒曼凭借根据阿加莎同名小说《东方快车谋杀案》改编的影片获得了第三座奥斯卡奖杯。阿加莎数以亿计的仰慕者中不乏显赫的人物，其中包括女王伊丽莎白二世和法国总统戴高乐。\n\n1976年，她以85岁高龄永别了热爱她的人们。', 'Murder on the Orient Express\n首刊於美国：Saturday Evening Post, 1933年9月30日-11月4日连载，题为Murder in the Calais Coach\n英国Grand Magazine, 1934年3-5月连载\n初版單行本：\n英国：Collins, 1934.01\n美国：Dodd Mead, 1934，题为Murder in the Calais Coach\n漢譯本：\n白勞特探案：東方快車謀殺案（上下兩冊） 上海華華書報社 194?(大陸淪陷前) 令狐慧 譯\n復仇記 臺灣大陸出版社 1959.03 李蕪 譯\n東方快車兇殺案 臺灣巨浪出版社 1975.04 文白 譯\n東方快車謀殺案 臺灣時報文化出版事业有限公司 1975.06.01 岳孫 譯\n东方快车谋杀案 中国电影出版社 1979.09 陈尧光 译\n东方快车上的谋杀案 浙江人民出版社 1979.12 宋兆霖 镕榕 译\n東方快車謀殺案(全集之3，初版) 臺灣遠景出版事業公司/香港明遠出版社 1982 張艾茜 譯\n東方快車謀殺案(全集之3，五版) 臺灣遠景出版事業公司 1988.12 張艾茜 譯\n東方快車謀殺案(全集之3，遠景袖珍版) 臺灣風雲時代出版公司 1990 張艾茜 譯\n東方快車謀殺案(全集之3，革新版) 臺灣遠景出版事業公司 1992 張艾茜 譯\n东方快车谋杀案(单行本) 华文出版社 1993.08 张艾茜 译\n东方快车谋杀案 外文出版社 1994.01 （中國出版的英文版）\n东方快车谋杀案(合订本1) 华文出版社 1995.01 张艾茜 译\n东方快车谋杀案 外文出版社 1996.01 （中國出版的英文版）\n东方快车谋杀案 贵州人民出版社 1998.10 陈尧光 译\n東方快車謀殺案 臺灣遠流出版事業股份有限公司 2002.02.01 陳堯光 譯\n东方快车谋杀案(收录于合集《世界侦探小说经典·欧美卷·下册》) 云南人民出版社 2002.11 唐仁 译\n东方快车谋杀案 人民文学出版社 2006.05 陈尧光 译\n佛蓝星双语名著导读·东方快车谋杀案(英汉对照) 2009.01 天津科技翻译出版公司 赵红霞 译\n东方快车谋杀案(32册波洛系列版) 人民文学出版社 2009.10 陈尧光 译\n東方快車謀殺案(克莉絲蒂120誕辰紀念版) 臺灣遠流出版事業股份有限公司 2010.08.01 陳堯光 譯\n东方快车谋杀案(作品集04) 新星出版社(午夜文库) 2013.05 郑桥 译\n东方快车谋杀案(午夜小红壳纪念版) 新星出版社 2017.07 郑桥 译\n（上主要據：阿加莎.克里斯蒂中文站http://www.cnajs.com/novel/18/18.htm）');
INSERT INTO `book` VALUES (41, '霍乱时期的爱情', '[哥伦比亚] 加西亚·马尔克斯', 9.0, 282374, '南海出版公司', '2012-09-01', '39.5', 's11284102.jpg', '爱情小说', '★马尔克斯唯一正式授权，首次完整翻译\n\n★《霍乱时期的爱情》是我最好的作品，是我发自内心的创作。——加西亚•马尔克斯\n\n★这部光芒闪耀、令人心碎的作品是人类有史以来最伟大的爱情小说。——《纽约时报》\n\n《霍乱时期的爱情》是加西亚•马尔克斯获得诺贝尔文学奖之后完成的第一部小说。讲述了一段跨越半个多世纪的爱情史诗，穷尽了所有爱情的可能性：忠贞的、隐秘的、粗暴的、羞怯的、柏拉图式的、放荡的、转瞬即逝的、生死相依的……再现了时光的无情流逝，被誉为“人类有史以来最伟大的爱情小说”，是20世纪最重要的经典文学巨著之一。', '加西亚•马尔克斯（Gabriel García Márquez）\n\n1927年出生于哥伦比亚马格达莱纳海滨小镇阿拉卡塔卡。童年与外祖父母一起生活。1936年随父母迁居苏克雷。1947年考入波哥大国立大学。1948年因内战辍学，进入报界。五十年代开始出版文学作品。六十年代初移居墨西哥。1967年《百年孤独》问世。1982年获诺贝尔文学奖。1985年出版《霍乱时期的爱情》。', '暂无目录信息');
INSERT INTO `book` VALUES (42, '基督山伯爵', '[法国] 大仲马', 9.1, 128519, '上海译文出版社', '1991-12-01', '43.9', 's3248016.jpg', '历史小说', '小说以法国波旁王朝和七月王朝两大时期为背景，描写了一个报恩复仇的故事。法老号大副唐泰斯受船长的临终嘱托，为拿破仑送了一封信，受到两个对他嫉妒的小人的陷害，被打入死牢，狱友法里亚神甫向他传授了各种知识，还在临终前把一批宝藏的秘密告诉了他。他设法越狱后找到了宝藏，成为巨富。从此他化名为基督山伯爵，经过精心策划，报答了他的恩人，惩罚了三个一心想置他于死地的仇人。', '法国19世纪积极浪漫主义作家。其祖父是候爵德·拉·巴那特里，与黑奴结合生下其父，名亚历山大，受洗时用母姓仲马。法国大革命爆发后，亚历山大·仲马屡建奇功，当上共和政府将军。大仲马终生信守共和政见，一贯反对君主专政，憎恨复辟王朝，不满七月王朝，反对第二帝国。他饱尝种族歧视，心中受到创伤。家庭出身和经历使大仲马形成了反对不平、追求正义的叛逆性格。大仲马自学成才，一生写的各种类型作品达300卷之多，主要以小说和剧作著称于世。大仲马的剧本《享利第三及其宫廷》（1829）比雨果的《欧那尼》还早问世一年。这出浪漫主义戏剧，完全破除了古典主义“三一律”。大仲马小说多达百部，大都以真实的历史作背景，以主人公的奇遇为内容，情节曲折生动，处处出人意外，堪称历史惊险小说。异乎寻常的理想英雄，急剧发展的故事情节，紧张的打斗动作，清晰明朗的完整结构，生动有力的语言，灵活机智的对话等构成了大仲马小说的特色。最著名的是《三个火枪手》旧译《三剑客》，（1844）、《基督山伯爵》。大仲马被别林斯基称为“一名天才的小说家”，他也是马克思 “最喜欢”的作家之一。', '一、船抵马赛\n二、父与子\n三、加泰罗尼亚人\n四、阴谋\n五、订婚宴席\n六、代理检察官\n七、审讯\n八、伊夫堡\n九、订婚之夜\n十、杜伊勒里宫的小书房');
INSERT INTO `book` VALUES (43, '江城', '[美国] 彼得·海斯勒', 9.1, 61950, '上海译文出版社', '2012-01-01', '36', 's32271204.jpg', '纪实文学', '1996年8月底一个温热而清朗的夜晚，我从重庆出发，乘慢船，顺江而下来到涪陵。\n\n涪陵没有铁路，历来是四川省的贫困地区，公路非常糟糕。去哪里你都得坐船，但多半你哪里也不会去。在随后的两年，这座城市就是我的家。\n\n在这里，我有时是一个旁观者，有时又置身于当地的生活之中，这种亲疏结合的观察构成了我在四川停留两年的部分生活。\n\n2001年，也就是这本书在美国出版的时候，一条通往重庆的高速公路通车了，一条铁路也正在修建之中，基本上再也没有人坐船去涪陵了。这座城市正在飞速发展着，在过去的二十年，那样一种转型变化的感觉——接二连三、冷酷无情、势不可挡——正是中国的本质特征。很难相信，这个国家曾经完全是另外一种模样，是19世纪西方人眼中“永远停滞的民族”。\n\n2003年，三峡大坝一期完工后，不断上涨的江水将陆续淹没那些江畔之城，这多少令我有些伤感。而对于大多数中国人来说，这正是不断变革的对应面：贫穷、烂路、慢船。\n\n这并不是一本关于中国的书，它只涉及一小段特定时期内中国的某个小地方。从地理和历史上看，涪陵都位于江河中游，所以人们有时很难看清她从何而来，又去往何处。\n\n在1996年至1998年间，我学会了热爱涪陵。能再次回到长江上的感觉真好，哪怕它的旧时激流只存于我的记忆之中。', '彼得·海斯勒(Peter Hessler)，中文名何伟，曾任《纽约客》驻北京记者，以及《国家地理》杂志等媒体的撰稿人。\n\n他成长于美国密苏里州的哥伦比亚市，在普林斯顿主修英文和写作，并取得牛津大学英语文学硕士学位。海斯勒曾自助旅游欧洲三十国，毕业后更从布拉格出发，由水陆两路横越俄国、中国到泰国，跑完半个地球，也由此开启了他的旅游文学写作之路。\n\n海斯勒散见于各大杂志的旅游文学作品，数度获得美国最佳旅游写作奖。他的中国纪实三部曲中，《江城》一经推出即获得“奇里雅玛环太平洋图书奖”，《甲骨文》则荣获《时代周刊》年度最佳亚洲图书等殊荣。海斯勒本人亦被《华尔街日报》赞为“关注现代中国的最具思想性的西方作家之一”。', '作者说明\n第一部 1\n第一章 顺江而下 3\n城市 28\n第二章 有中国特色的莎士比亚 35\n插旗山 59\n第三章 跑步 65\n白鹤梁 104\n第四章 大坝 110\n乌江 137\n第五章 鸦片战争 143\n白山坪 166\n第六章 暴风雨 174\n第二部 197\n第七章 暑假 199\n神甫 237\n第八章 中国生活 244\n老板 268\n第九章 钱 274\n老师 309\n第十章 农历新年 316\n土地 348\n第十一章 又一春 353\n长江 384\n第十二章 溯江而上 391\n致谢 433\n回到涪陵 435\n译后记 441');
INSERT INTO `book` VALUES (44, '卡拉马佐夫兄弟', '陀思妥耶夫斯基', 9.6, 32375, '上海译文出版社', '2015-02-01', '78', 's28383857.jpg', '长篇小说', '本书系俄国大作家陀思妥耶夫斯基代表作之一。小说通过一桩真实的弑父案，描写老卡拉马佐夫同三个儿子即两代人之间的尖锐冲突。老卡拉马佐夫贪婪好色，独占妻子留给儿子们的遗产，并与长子德米特里为一个风流女子争风吃醋。一天黑夜，德米特里疑心自己的情人去跟老头儿幽会，便闯入家园，一怒之下，差点儿把老头儿砸死。他仓皇逃离后，躲在暗中装病的老卡拉马佐夫的私生子斯乜尔加科夫，悄然杀死老爷，造成了一桩震惊全俄的扑朔迷离的血案，从而引发了一连串惊心动魄的事件。作品展示一个错综复杂的社会家庭、道德和人性的悲剧主题，体现了作家一生的最高艺术成就。', '陀思妥耶夫斯基(1821-1881)，与大文豪列夫·托尔斯泰、屠格涅夫等人齐名，是俄国文学的卓越代表，他走的是一条极为艰辛、复杂的生活与创作道路，是俄国文学史上最复杂、最矛盾的，作家之一。他的创作独具特色，在群星灿烂的19世纪俄国文坛上独树一帜，占有着十分特殊的地位。主要作品有《穷人》、《被侮辱与被损害的》、《死屋手记》、《罪与罚》、《白痴》、《群魔》、《卡拉马佐夫兄弟》等。', '作者的话\n献词\n重要任务表\n第一卷 一户人家的历史\n一 费尧多尔·巴甫洛维奇·卡拉马佐夫\n二 甩掉第一个儿子\n三 续弦与续弦所出\n四 老三阿辽沙\n五 长老\n第二卷 不该举行的聚会\n一 到达修道院\n二 老小丑\n三 信女\n四 一位信仰不坚定的女士\n五 定当如此，定当如此！\n六 干吗让这号人活在世上？！\n七 野心勃勃的宗教学校毕业生\n八 丑剧\n第三卷 洒色之徒\n一 下房\n二 黎萨维塔·斯乜尔加夏娅\n三 一颗炽热的心的自白(诗体)\n四 一颗炽热的心的自白(故事体)\n五 一颗炽热的心的自白(局面倒了个过儿)\n六 斯乜尔加科夫\n七 争论\n八 微醺之余\n九 色情狂\n十 她俩都在那儿\n十一 又一个人的名誉扫地\n第四卷 咄咄怪事\n一 菲拉邦特神父\n二 在父亲那儿\n三 遇上了一群学童\n四 在霍赫拉科娃家\n五 客厅里的怪事\n六 陋居里的怪事\n七 清爽空气中也有怪事\n第五卷 正与反\n一 相约\n二 怀抱吉他的斯乜尔加科夫\n三 兄弟间相互了解\n四 反叛\n五 宗教大法官\n六 这一章的关键作用暂时还很模糊\n七 “跟聪明人谈话就是有意思”\n第六卷 俄罗斯修士\n一 佐西马长老和他的客人们\n二 已故司祭苦修僧佐西马长老牛平，由阿列克塞·费尧多罗维奇·卡拉马佐夫据长老自述整理\n三 佐西马长老的谈话及训示摘要\n第七卷 阿辽沙\n一 腐臭\n二 节骨眼\n三 一个葱头\n四 加利利的迦拿\n第八卷 米嘉\n一 库兹马·萨姆索诺夫\n二 里亚加维\n三 金矿\n四 黑暗中\n五 突然的决定\n六 我来了！\n七 拥有当然权利的旧情人\n八 撒呓挣\n第九卷 预审\n一 别尔霍津腾达之始\n二 案发\n三 灵魂的磨难历程。磨难之一\n四 磨难之二\n五 磨难之三\n六 检察官把米嘉逼到了死角\n七 米嘉的大秘密。遭嘘\n八 证人之言。娃子\n九 米嘉被押走了\n第十卷 大男孩和小男孩\n一 郭立亚·克拉索特金\n二 小家伙\n三 预备生\n四 茹企卡\n五 在伊柳沙的病榻旁\n六 早熟\n七 伊柳沙\n第十一卷 伊万\n一 在格露莘卡家里\n二 纤足有恙\n三 魔崽\n四 一首颂诗和一个秘密\n五 不是你，不是你！\n六 第一次走访斯乜尔加科夫\n七 第二次走访斯乜尔加科夫\n八 第三次、也是最后一次走访斯乜尔加科夫\n九 魔鬼。伊万·费尧多罗维奇的梦魇\n十 “这是他说的”\n第十二卷 错案\n一 生死攸关的一天\n二 危险的证人\n三 医学鉴定和一斤榛子\n四 幸运向米嘉微笑\n五 突然降临的灾祸\n六 公诉人的演说。性格概述\n七 历史的回顾\n八 斯乜尔加科夫论\n九 洋洋洒洒的心理学高论。飞驰的三驾马车。公诉人演说的结尾\n十 辩护人的演说。一把双刃刀\n十一 钱本来就没有。盗案也没有发生\n十二 谋杀也是没有的事\n十三 蛊惑者\n十四 乡下人不买账\n尾声\n一 营救米嘉的计划\n二 谎言一时间成了真话\n三 伊柳沙的葬礼。巨石旁的演说\n译后记');
INSERT INTO `book` VALUES (45, '城南旧事', '林海音', 9.1, 155374, '中国青年出版社', '2003-07-01', '16', 's2654869.jpg', '短篇小说', '多少年来，《城南旧事》感动了一代又一代的读者，除了再版无数次的小说版外，1985年，本书在中国大陆搬上银幕，电影“城南旧事”获得“中国电影金鸡奖”、第二届“马尼拉国际电影节最佳故事片奖金鹰奖章”、第十四届“贝尔格勒国际儿童电影节最佳影片思想奖”等多项大奖。\n\n儿童绘本版《城南旧事》由当今中国极具代表性的水彩画家关维兴，运用优雅诗意的风格和穿透人心的独到技巧，将创作的图画全然融入故事的情节。画中举凡服饰、器物和建筑，考据详实，没一点随便或含糊。人物细致的表情、光线和空气的律动、圆熟丰美的调子，使文图呈现无懈可击的呼应。绘本《城南旧事》甫出版即获选1993、1994年“波隆那国际儿童书插画展”、1993年“布拉迪斯国际插画双年展”以及1994年“加泰隆尼亚国际插画双年展”。\n\n从小说到电影，从成人书到儿童绘本，《城南旧事》是故事、是梦幻，读时仿若音乐，轻轻扣动人心，字里行间所隐涵的深意，更令人撼动，久久不能自已。', '林海音（1918-2001），现代女作家。她原籍台湾苗栗，生于日本，长于北京。1960年以小说《城南旧事》成名。林海音不仅创作了许多小说和散文作品，她在出版业上亦有许多成绩。从1951年开始，她主编《联合报》副刊10年，树立了编辑的典范，提升了文艺副刊的水准和地位；1961年创办“纯文学出版社”，发掘鼓励许许多多的年轻作家。', '冬阳 童年 骆驼队\n惠安馆\n我们看海去\n兰姨娘\n驴打滚儿\n爸爸的花儿落了');
INSERT INTO `book` VALUES (46, 'Python编程（第3版）', '[美] 埃里克 • 马瑟斯', 9.3, 183, '人民邮电出版社', '2023-05-03', '109.8', 's34505252.jpg', '计算机编程', '本书是针对所有层次的 Python 读者而作的 Python 入门书。全书分为两部分：第一部分介绍使用Python 编程所必须了解的基本概念，包括强大的 Python 库和工具，以及列表、字典、if 语句、类、文件和异常、测试代码等内容；第二部分将理论付诸实践，讲解如何开发三个项目，包括简单的 2D 游 戏、利用数据生成交互式的信息图以及创建和定制简单的 Web 应用程序，并帮助读者解决常见编程问题和困惑。第 3 版进行了全面修订：使用了文本编辑器 VS Code，新增了介绍 removeprefix() 方法和removesuffix() 方法的内容，并且在项目中利用了Matplotlib 和 Plotly 的最新特性，等等。', '埃里克·马瑟斯（Eric Matthes）\n\n缔造技术图书销售奇迹的作家，作品影响了全球数百万读者。\n\n致力于推动Python编程在全球的普及。执教计算机科学和数学25年，教学风格轻松有趣，深受学生喜爱。他对编程的热爱和丰厚的教学经验淋漓尽致地体现在了蟒蛇书《Python编程：从入门到实践》中。\n\n蟒蛇书备受读者推崇。无论是熟练掌握其他编程语言的程序员，还是年仅10岁的萌新，都是本书拥趸。该书在全球范围内被翻译为12种语言，累计热销近300万册，其中仅中文版前两版的销量就超过了120万册。', '第一部分　基础知识\n第1章　起步 2\n1.1　编程环境简介 2\n1.1.1　Python版本 2\n1.1.2　运行Python代码片段 2\n1.1.3　编辑器VS Code简介 3\n1.2　在各种操作系统中搭建Python编程\n环境 3\n1.2.1 在Windows系统中搭建Python编程环境 4\n1.2.2　在macOS系统中搭建Python编程环境 5\n1.2.3　在Linux系统中搭建Python\n编程环境 6\n1.3　运行Hello World程序 7\n1.3.1　给VS Code安装Python扩展 7\n1.3.2　运行程序hello_world.py 8\n1.4　排除安装问题 8\n1.5　从终端运行Python程序 9\n1.5.1　在Windows系统中从终端\n运行Python程序 9\n1.5.2　在Linux和macOS系统中从\n终端运行Python程序 10\n1.6　小结 11\n第2章　变量和简单的数据类型 12\n2.1　运行hello_world.py时发生的情况 12\n2.2　变量 12\n2.2.1　变量的命名和使用 13\n2.2.2　如何在使用变量时避免命名\n错误 14\n2.2.3　变量是标签 15\n2.3　字符串 16\n2.3.1　使用方法修改字符串的大小写 16\n2.3.2　在字符串中使用变量 17\n2.3.3　使用制表符或换行符来添加\n空白 18\n2.3.4　删除空白 18\n2.3.5　删除前缀 20\n2.3.6　如何在使用字符串时避免语法错误 20\n2.4　数 22\n2.4.1　整数 22\n2.4.2　浮点数 23\n2.4.3　整数和浮点数 23\n2.4.4　数中的下划线 24\n2.4.5　同时给多个变量赋值 24\n2.4.6　常量 24\n2.5　注释 25\n2.5.1　如何编写注释 25\n2.5.2　该编写什么样的注释 25\n2.6　Python之禅 26\n2.7　小结 27\n第3章　列表简介 28\n3.1　列表是什么 28\n3.1.1　访问列表元素 28\n3.1.2　索引从0而不是1开始 29\n3.1.3　使用列表中的各个值 30\n3.2　修改、添加和删除元素 30\n3.2.1　修改列表元素 31\n3.2.2　在列表中添加元素 31\n3.2.3　从列表中删除元素 32\n3.3　管理列表 37\n3.3.1　使用sort()方法对列表进行永久排序 37\n3.3.2　使用sorted()函数对列表进行临时排序 37\n3.3.3　反向打印列表 38\n3.3.4　确定列表的长度 39\n3.4　使用列表时避免索引错误 40\n3.5　小结 41\n第4章　操作列表 42\n4.1　遍历整个列表 42\n4.1.1　深入研究循环 43\n4.1.2　在for循环中执行更多的操作 44\n4.1.3　在for循环结束后执行一些\n操作 45\n4.2　避免缩进错误 45\n4.2.