INSERT INTO `book` VALUES (47, '程序员修炼之道（第2版）', '[美] David Thomas / [美] Andrew Hunt', 9.0, 735, '电子工业出版社', '2020-04-01', '89', 's33836286.jpg', '计算机编程', '本书之所以在全球范围内广泛传播，被一代代开发者奉为圭臬，盖因它可以创造出真正的价值：或编写出更好的软件，或探究出编程的本质，而所有收获均不依赖于特定语言、框架和方法。时隔20年的新版，经过全面的重新选材、组织和编写，覆盖哲学、方法、工具、设计、解耦、并发、重构、需求、团队等务实话题的最佳实践及重大陷阱，以及易于改造、复用的架构技术。本书极具洞察力与趣味性，适合从初学者到架构师的各阶层读者潜心研读或增广见闻。', 'Dave Thomas 喜欢驾驶单引擎飞机飞行，而之所以能负担这样奢侈的爱好，是因为他擅长于为各种难题寻找优雅的解决方案，提供诸多领域的咨询服务——航空、银行、金融服务、电信、交通运输及互联网。1994年移居美国前，他在英国创立了一家通过 ISO9001 认证的软件公司，为世界各地的客户开发成熟、定制的软件项目。Dave 现在是一位独立顾问，居住在美国得克萨斯州达拉斯。\n\nAndy Hunt 是一位热情的木匠和音乐家。奇怪的是，他另一个顾问的身份更为人们所推崇。他的工作领域包括电信、银行、金融服务、公共服务，以及一些更奇特的领域，比如医学成像、图形艺术、互联网服务。他的专长是把经过验证的技术与先进的技术融合在一起，创建各种新颖且实用的解决方案。Andy 在美国北卡罗莱纳州罗利市拥有自己的顾问公司。', '序\n新版前言\n第一版前言\n提示1 关注你的技艺\n提示2 思考！思考你的工作\n第1章 务实的哲学\n1 人生是你的\n提示3 你有权选择\n2 我的源码被猫吃了\n提示4 提供选择，别找借口\n3 软件的熵\n提示5 不要放任破窗\n4 石头做的汤和煮熟的青蛙\n提示6 做推动变革的催化剂\n提示7 牢记全景\n5 够好即可的软件\n提示8 将质量要求视为需求问题\n6 知识组合\n提示9 对知识组合做定期投资\n提示10 批判性地分析你读到和听到的东西\n7 交流！\n提示11 英语就是另一门编程语言\n提示12 说什么和怎么说同样重要\n提示13 把文档嵌进去，而不要栓在表面\n第2章 务实的方法\n8 优秀设计的精髓\n提示14 优秀的设计比糟糕的设计更容易变更\n9 DRY ——邪恶的重复\n提示15 DRY——不要重复自己\n提示16 让复用变得更容易\n10 正交性\n提示17 消除不相关事物之间的影响\n11 可逆性\n提示18 不设最终决定\n提示19 放弃追逐时尚\n12 曳光弹\n提示20 使用曳光弹找到目标\n13 原型与便签\n提示21 用原型学习\n14 领域语言\n提示22 靠近问题域编程\n15 估算\n提示23 通过估算来避免意外\n提示24 根据代码不断迭代进度表\n第3章 基础工具\n16 纯文本的威力\n提示25 将知识用纯文本保存\n17 Shell游戏\n提示26 发挥 Shell 命令的威力\n18 加强编辑能力\n提示27 游刃有余地使用编辑器\n19 版本控制\n提示28 永远使用版本控制\n20 调试\n提示29 去解决问题，而不是责备\n提示30 不要恐慌\n提示31 修代码前先让代码在测试中失败\n提示32 读一下那些该死的出错信息\n提示33 “select”没出问题\n提示34 不要假设，要证明\n21 文本处理\n提示35 学习一门文本处理语言\n22 工程日记\n第4章 务实的偏执\n提示36 你无法写出完美的软件\n23 契约式设计\n提示37 通过契约进行设计\n24 死掉的程序不会说谎\n提示38 尽早崩溃\n25 断言式编程\n提示39 使用断言去预防不可能的事情\n26 如何保持资源的平衡\n提示40 有始有终\n提示41 在局部行动\n27 不要冲出前灯范围\n提示42 小步前进——由始至终\n提示43 避免占卜\n第5章 宁弯不折\n28 解耦\n提示44 解耦代码让改变更容易\n提示45 只管命令不要询问\n提示46 不要链式调用方法\n提示47 避免全局数据\n提示48 如果全局唯一非常重要，那么将它包装到API 中\n29 在现实世界中抛球杂耍\n30 变换式编程\n提示49 编程讲的是代码，而程序谈的是数据\n提示50 不要囤积状态，传递下去\n31 继承税\n提示51 不要付继承税\n提示52 尽量用接口来表达多态\n提示53 用委托提供服务：“有一个”胜过“是一个”\n提示54 利用 mixin 共享功能\n32 配置