INSERT INTO `book` VALUES (49, '程序员的README', '[美] 克里斯·里科米尼', 8.7, 104, '人民邮电出版社', '2023-07-10', '79.8', 's34570616.jpg', '计算机编程', '对于刚刚成为软件工程师的新手来说，知道如何编写代码只是成功了一半。你可能很快就会发现，学校并没有教授在现实世界中至关重要的技能和工作中必要的流程。本书恰恰填补了这一环节，它是作者十多年来在大型公司指导初级工程师工作的教程，涵盖软件工程的基础知识和最佳实践。\n\n本书第1～2 章讲解当你在公司开启你的职业生涯时会发生什么；第3～11 章会扩展你的工作技能，教你如何使用现有代码库、解决和防止技术债、编写生产级软件、管理依赖关系、有效地测试、评审代码、交付软件、处理On-Call 时的事故和构建可演进的架构等；剩余章节涵盖管理能力和职业阶梯的提升等相关内容，例如敏捷计划、与管理者合作以及成长为资深工程师的必经之路。本书中非常重要的一部分内容是教你如何应对糟糕的管理，以及如何调整自己的节奏。\n\n本书内容不仅浅显易懂，还覆盖整个软件开发周期，是一本技术主管希望每名新入行的工程师在开始工作之前都能阅读的书。', '克里斯·里科米尼（Chris Riccomini）：\n\n软件工程师，创业公司投资者和顾问，在PayPal、领英和WePay等大型科技公司拥有超过十年的工作经验；在职业生涯中一直参与开源项目的工作，是Apache Samza的作者。\n\n德米特里·里亚博伊（Dmitriy Ryaboy）：\n\n软件工程师和工程经理；目前担任Zymergen公司的软件工程副总裁；曾就职于不同的公司和组织，包括劳伦斯伯克利国家实验室、Cloudera和Twitter；帮助创建和发展了多个开源项目，包括Apache Parquet。\n\n（译者）付裕，软件工程师，专注于移动终端领域研发管理；公众号“UNI通识”主理人。', '第1 章 前面的旅程 1\n1.1 你的目的地 1\n1.2 你的旅程地图 2\n1.2.1 新手营 3\n1.2.2 试炼之河 5\n1.2.3 贡献者之角 5\n1.2.4 运维之海 6\n1.2.5 胜任之湾 6\n1.3 前进！ 7\n第2 章 步入自觉阶段 8\n2.1 学习如何学习 9\n2.1.1 前置学习 9\n2.1.2 在实践中学习 9\n2.1.3 运行实例代码 11\n2.1.4 阅读 11\n2.1.5 观看讲座 13\n2.1.6 适度地参加会议和聚会 14\n2.1.7 跟班学习并同有经验的工程师结对 15\n2.1.8 用副业项目实践 16\n2.2 提出问题 17\n2.2.1 动手调查一下 17\n2.2.2 设置一个时间限制 17\n2.2.3 写下全过程 18\n2.2.4 别打扰别人 19\n2.2.5 多用“非打扰式”交流 20\n2.2.6 批量处理你的同步请求 20\n2.3 克服成长的障碍 21\n2.3.1 冒充者综合征 21\n2.3.2 邓宁-克鲁格效应 22\n2.4 行为准则 23\n2.5 升级加油站 23\n第3 章 玩转代码 25\n3.1 软件的熵 26\n3.2 技术债 26\n3.3 变更代码 29\n3.3.1 善于利用现有代码 30\n3.3.2 过手的代码要比之前更干净 32\n3.3.3 做渐变式的修改 33\n3.3.4 对重构要务实 33\n3.3.5 善用IDE 34\n3.3.6 请使用VCS 的最佳实践 34\n3.4 避“坑”指南 35\n3.4.1 保守一些的技术选型 36\n3.4.2 不要特立独行 39\n3.4.3 不要只分叉而不向上游提交修改 40\n3.4.4 克制重构的冲动 40\n3.5 行为准则 42\n3.6 升级加油站 42\n第4 章 编写可维护的代码 44\n4.1 防御式编程 45\n4.1.1 避免空值 45\n4.1.2 保持变量不可变 46\n4.1.3 使用类型提示和静态类型检查器 46\n4.1.4 验证输入 47\n4.1.5 善用异常 49\n4.1.6 异常要有精确含义 50\n4.1.7 早抛晚捕 51\n4.1.8 智能重试 52\n4.1.9 构建幂等系统 53\n4.1.10 及时释放资源 53\n4.2 关于日志的使用 54\n4.2.1 给日志分级 55\n4.2.2 日志的原子性 56\n4.2.3 关注日志性能 57\n4.2.4 不要记录敏感数据 59\n4.3 系统监控 59\n4.3.1 使用标准的监控组件 60\n4.3.2 测量一切 63\n4.4 跟踪器 64\n4.5 配置相关注意事项 64\n