INSERT INTO `book` VALUES (50, 'C++ Primer 中文版（第 5 版）', '[美] Stanley B. Lippman', 9.5, 2793, '电子工业出版社', '2013-09-01', '128', 's33903490.jpg', '计算机编程', '这本久负盛名的 C++ 经典教程，时隔八年之久，终迎来史无前例的重大升级。除令全球无数程序员从中受益，甚至为之迷醉的——C++ 大师 Stanley B. Lippman 的丰富实践经验，C++标准委员会原负责人 Josée Lajoie 对C++标准的深入理解，以及C+ + 先驱 Barbara E. Moo 在 C++教学方面的真知灼见外，更是基于全新的 C++11标准进行了全面而彻底的内容更新。非常难能可贵的是，本书所有示例均全部采用 C++11 标准改写，这在经典升级版中极其罕见——充分体现了 C++ 语言的重大进展及其全面实践。书中丰富的教学辅助内容、醒目的知识点提示，以及精心组织的编程示范，让这本书在 C++ 领域的权威地位更加不可动摇。无论是初学者入门，或是中、高级程序员提升，本书均为不容置疑的首选。', 'Stanley B. Lippman目前是微软公司Visual C++团队的架构师。他从1984年开始在贝尔实验室与C++的设计者Bjarne Stroustrup一起从事C++的设计与开发。他在迪士尼和梦工厂从事动画制作，还担任过JPL的高级顾问。\n\nJosée Lajoie曾经是IBM加拿大研究中心C/C++编译器开发团队的成员，在ISO C++标准委员会工作了7年，担任过ISO核心语言工作组的主席和C++ Report杂志的专栏作家。\n\nBarbara E. Moo是拥有25年软件经验的独立咨询顾问。在AT&T，她与Stroustrup、Lippman一起管理过复杂的C++开发项目。', '第1章 开始 1\n1.1 编写一个简单的C++程序 2\n1.1.1 编译、运行程序 3\n1.2 初识输入输出 5\n1.3 注释简介 8\n1.4 控制流 10\n1.4.1 while语句 10\n1.4.2 for语句 11\n1.4.3 读取数量不定的输入数据 13\n1.4.4 if语句 15\n1.5 类简介 17\n1.5.1 Sales_item类 17\n1.5.2 初识成员函数 20\n1.6 书店程序 21\n小结 23\n术语表 23\n第Ⅰ部分 C++基础 27\n第2章 变量和基本类型 29\n2.1 基本内置类型 30\n2.1.1 算术类型 30\n2.1.2 类型转换 32\n2.1.3 字面值常量 35\n2.2 变量 38\n2.2.1 变量定义 38\n2.2.2 变量声明和定义的关系 41\n2.2.3 标识符 42\n2.2.4 名字的作用域 43\n2.3 复合类型 45\n2.3.1 引用 45\n2.3.2 指针 47\n2.3.3 理解复合类型的声明 51\n2.4 const限定符 53\n2.4.1 const的引用 54\n2.4.2 指针和const 56\n2.4.3 顶层const 57\n2.4.4 constexpr和常量表达式 58\n2.5 处理类型 60\n2.5.1 类型别名 60\n2.5.2 auto类型说明符 61\n2.5.3 decltype类型指示符 62\n2.6 自定义数据结构 64\n2.6.1 定义Sales_data类型 64\n2.6.2 使用Sales_data类 66\n2.6.3 编写自己的头文件 67\n小结 69\n术语表 69\n第3章 字符串、向量和数组 73\n3.1 命名空间的using声明 74\n3.2 标准库类型string 75\n3.2.1 定义和初始化string对象 76\n3.2.2 string对象上的操作 77\n3.2.3 处理string对象中的字符 81\n3.3 标准库类型vector 86\n3.3.1 定义和初始化vector对象 87\n3.3.2 向vector对象中添加元素 90\n3.3.3 其他vector操作 91\n3.4 迭代器介绍 95\n3.4.1 使用迭代器 95\n3.4.2 迭代器运算 99\n3.5 数组 101\n3.5.1 定义和初始化内置数组 101\n3.5.2 访问数组元素 103\n3.5.3 指针和数组 105\n3.5.4 C风格字符串 109\n3.5.5 与旧代码的接口 111\n3.6 多维数组 112\n小结 117\n术语表 117\n第4章 表达式 119\n4.1 基础 120\n4.1.1 基本概念 